-- ----------------------------
-- Table structure for `products`
-- ----------------------------
DROP TABLE IF EXISTS `products`;
CREATE TABLE `products` (
  `uid` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `price` int(5) NOT NULL DEFAULT '0',
  `user_id` varchar(128) COLLATE utf8_czech_ci DEFAULT NULL,
  `main_category_id` int(10) unsigned NOT NULL DEFAULT '1' COMMENT 'The Category the product belongs to',
  `manufacturer_id` int(10) unsigned DEFAULT NULL COMMENT 'ID of the assigned manufacturer',
  `default_image_id` int(10) unsigned DEFAULT NULL COMMENT 'ID of ProductImage, which has been designated as the default image for the particular product',
  `parent_id` int(10) unsigned DEFAULT NULL,
  `is_enabled` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'Determines if the Product is enabled (visible and available in the store frontend) 0- not available 1- available 2- disabled (not visble)',
  `content_id` int(10) unsigned DEFAULT NULL,
  `name` varchar(255) COLLATE utf8_czech_ci DEFAULT NULL COMMENT 'Product name (translatable)',
  `short_description` mediumtext COLLATE utf8_czech_ci COMMENT 'A shorter description of the product (translatable). The short description is usually displayed in the category product list',
  `description` longtext COLLATE utf8_czech_ci COMMENT 'A longer description of the product (translatable). The long description is usually displayed in the product detail page',
  `keywords` text COLLATE utf8_czech_ci COMMENT 'Additional product search keywords, which may not be included in the product name or description, but can be used when a customer searches for a product',
  `date_created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Product creation date',
  `date_updated` timestamp NULL DEFAULT NULL COMMENT 'Product last update date',
  `url` tinytext COLLATE utf8_czech_ci COMMENT 'External website URL (manufacturers website, etc.)',
  `is_finished` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'Determines if the product has been marked as featured product',
  `type` tinyint(3) unsigned DEFAULT '0' COMMENT 'Determines if the product is intangible (1) or tangible (0)',
  `vote_sum` int(10) unsigned DEFAULT '0' COMMENT 'Sum of all rating votes',
  `vote_count` int(10) unsigned DEFAULT '0' COMMENT 'Count of all rating votes',
  `rating` float DEFAULT NULL COMMENT 'Product rating (voteSum divided by voteCount)',
  `hits` int(10) unsigned DEFAULT '0' COMMENT 'Number of times the product has been viewed by customers',
  `minimum_quantity` float DEFAULT NULL COMMENT 'Minimum amount of the product that can be ordered',
  `shipping_surcharge` decimal(12,2) DEFAULT NULL COMMENT 'Additional surcharge for shipping (extra large, etc. items)',
  `is_separate_shipment` tinyint(1) NOT NULL COMMENT 'Determines if a separate shipment is required for delivering this product',
  `is_free_shipping` tinyint(1) NOT NULL COMMENT 'Determines if free shipping is available for this product',
  `is_back_orderable` tinyint(1) NOT NULL COMMENT 'Determines if this product is available for backordering. If backordering is enabled, customers can order the product even if it is out of stock',
  `is_fractional_unit` tinyint(1) NOT NULL,
  `shipping_weight` decimal(8,3) DEFAULT NULL COMMENT 'Weight of the product (including shipping wrappers, etc). This value is used for calculating the shipping rates.',
  `stock_count` float DEFAULT NULL COMMENT 'Number of products in stock',
  `reserved_count` float DEFAULT NULL COMMENT 'Number of products that are reserved (ordered and in stock but not delivered yet)',
  `sales_rank` int(11) DEFAULT NULL COMMENT 'Number of products sold',
  `ordering` int(10) unsigned DEFAULT '0',
  `images` mediumtext COLLATE utf8_czech_ci,
  `is_new` tinyint(1) NOT NULL DEFAULT '0',
  `is_recommended` tinyint(1) NOT NULL DEFAULT '1',
  `is_other_flag` tinyint(1) NOT NULL DEFAULT '0',
  `icons` varchar(128) COLLATE utf8_czech_ci NOT NULL,
  `availability` varchar(64) COLLATE utf8_czech_ci DEFAULT NULL,
  `cool_url` varchar(60) COLLATE utf8_czech_ci NOT NULL,
  `vat` tinyint(2) unsigned NOT NULL,
  `company_id` int(1) unsigned DEFAULT NULL COMMENT 'To indicate is this course is company level or not',
  PRIMARY KEY (`uid`),
  UNIQUE KEY `content_id` (`content_id`),
  KEY `IDX_Product_SKU` (`content_id`),
  KEY `IDX_Product_isEnabled` (`is_enabled`),
  KEY `IDX_Product_dateCreated` (`date_created`),
  KEY `IDX_Product_isFeatured` (`is_finished`),
  KEY `IDX_Product_rating` (`rating`),
  KEY `IDX_Product_salesRank` (`sales_rank`),
  KEY `Manufacturer_Product` (`manufacturer_id`),
  KEY `ProductImage_Product` (`default_image_id`),
  KEY `Product_Product` (`parent_id`),
  KEY `IDX_Product_Category` (`main_category_id`),
  KEY `user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=71 DEFAULT CHARSET=utf8 COLLATE=utf8_czech_ci;

