-- ----------------------------
-- Table structure for `videos`
-- ----------------------------
DROP TABLE IF EXISTS `videos`;
CREATE TABLE `videos` (
  `uid` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `parent_id` int(10) unsigned DEFAULT NULL,
  `user_id` varchar(128) COLLATE utf8_czech_ci DEFAULT NULL,
  `is_enabled` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'Determines if the Product is enabled (visible and available in the store frontend) 0- not available 1- available 2- disabled (not visble)',
  `name` varchar(255) COLLATE utf8_czech_ci DEFAULT NULL COMMENT 'Product name (translatable)',
  `short_description` mediumtext COLLATE utf8_czech_ci COMMENT 'A shorter description of the product (translatable). The short description is usually displayed in the category product list',
  `description` longtext COLLATE utf8_czech_ci COMMENT 'A longer description of the product (translatable). The long description is usually displayed in the product detail page',
  `keywords` text COLLATE utf8_czech_ci COMMENT 'Additional product search keywords, which may not be included in the product name or description, but can be used when a customer searches for a product',
  `date_created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Product creation date',
  `date_updated` timestamp NULL DEFAULT NULL COMMENT 'Product last update date',
  `url` tinytext COLLATE utf8_czech_ci COMMENT 'External website URL (manufacturers website, etc.)',
  `is_featured` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'Determines if the product has been marked as featured product',
  `type` tinyint(3) unsigned DEFAULT '0' COMMENT 'Determines if the product is intangible (1) or tangible (0)',
  `hits` int(10) unsigned DEFAULT '0' COMMENT 'Number of times the product has been viewed by customers',
  `ordering` int(10) unsigned DEFAULT '0',
  `images` mediumtext COLLATE utf8_czech_ci,
  `is_finished` tinyint(1) NOT NULL DEFAULT '0',
  `icons` varchar(128) COLLATE utf8_czech_ci NOT NULL,
  `cool_url` varchar(128) COLLATE utf8_czech_ci NOT NULL,
  `content_id` int(10) unsigned DEFAULT NULL,
  `zones` varchar(64) CHARACTER SET utf8 DEFAULT NULL,
  `files` mediumtext COLLATE utf8_czech_ci,
  `instructions` longtext COLLATE utf8_czech_ci,
  `predefinedtask` tinyint(1) DEFAULT NULL,
  `company_id` int(1) unsigned DEFAULT NULL COMMENT 'To indicate is this video(lession or quiz) is company level or not',
  `chapterplaybackpause` tinyint(1) DEFAULT NULL COMMENT 'to indicate is this chapter is hidden',
  PRIMARY KEY (`uid`),
  UNIQUE KEY `content_id` (`content_id`),
  KEY `IDX_Product_isEnabled` (`is_enabled`),
  KEY `IDX_Product_dateCreated` (`date_created`),
  KEY `IDX_Product_isFeatured` (`is_featured`),
  KEY `Product_Product` (`parent_id`),
  KEY `user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=62 DEFAULT CHARSET=utf8 COLLATE=utf8_czech_ci;

