INSERT INTO `cuepoints` VALUES ('1', '194', 'CH', 'Introduction, Agenda', '0', '109', '1', '\nThe following lesson covers the topic of beam mesh. In this lesson, I will introduce you to the beam line element. In practical applications with many long and slender members, beam element is essential because of its efficiency. I will cover the basic concepts such as the beam joints, beam meshing, and application of fixtures and loads. I will discuss the beam to joint connections, and I will of course also show you postprocessing. Because postprocessing beams is a little more involved, I will additionally cover in detail the beam stress types, and I will show you an example of a beam validation procedure.\n\nThis beam mesh lesson is divided into five [5] parts. The following lesson covers the topic of beam mesh, and is divided into five [5] parts. Please watch all parts in the given order. I will       now begin with part one [1]. This first part will demonstrate a limited applicability of solid mesh in slender long members, and it will also help me establish a solution reference. The duration of this part is approximately fifteen minutes [15 minutes].\n\nThe model presented in this lesson is a central pipe support frame of a dosing skid.\nDosing systems are used in several applications such as cooling water circuits, boiler feed water systems, waste water treatment, PH correction or even the flue gas cleaning.\nPump dosing systems offer the best options when considering the operation and maintenance safety. Dosing skids are designed to deliver the correct chemical at an optimum rate and in the most effective way.\nThey usually consist of tanks and pumps which assist the dosing process. There are also other supporting equipment like valves, fittings, control equipment which are part of the presented model.', '0', '0');
INSERT INTO `cuepoints` VALUES ('2', '194', 'CH', 'Model definition, Agenda', '109', '201', '1', '\nSince the frame is used to dose chemicals, it is manufactured from higher grade stainless steel, AISI three-sixteen [AISI 316L]. You can find this material in the SolidWorks database.\nThe yield strength of this material is a hundred and seventy megapascals [170 MPa], an d its tensile strength is four hundred and eighty five megapascals [485 MPa].\n\nDesign limits for this problem were set as a hundred and thirty megapascals [130 MPa] for the maximum stress, which represents a factor of safety of one point three [1.3], and five millimetres [5 mm] for the maximum displacement.\n\n\n\n[Model definition]\nThis central, pipe-supporting frame consist exclusively of welded slender members. There are additional parts like feet plates, and drip tray lugs which can be omitted from general strength analysis. The frame also features corner gussets which add lateral stiffness to the frame members. Their influence will be assessed later in this lesson. \n\n[PIP main goal, solid mesh] The main goal of this lesson, however, is to introduce you to a new element type called beam element. I will use this element to check the structural integrity of the frame.', '0', '0');
INSERT INTO `cuepoints` VALUES ('3', '194', 'CH', 'Solids study', '201', '224', '1', '\n\nIn the first part we will analyze the frame using coarser solid elements. I will use the coarser solid mesh results to establish a solution reference for the subsequent studies utilizing much more efficient beam elements. I could also use coarser shell mesh, but this would require tedious pre-processing which I would want to avoid at this point.', '0', '0');
INSERT INTO `cuepoints` VALUES ('4', '194', 'CH', 'Element selection, Simplification', '224', '333', '1', '\nI will open the Frame part. I will define a new static study called “solids”; and review the parts folder. The parts folder keeps the same subfolder structure as the SolidWorks feature tree. As I am expanding all subfolders, notice that all frame components are identified with the beam mesh icon next to them. Because the frame components are created using the SolidWorks weldments feature, simulation automatically assumes that you plan on using beam elements. △  The gussets, lugs and the feet are left as solids of course, hence some of the components in the tree are identified with the solid icon. Because I want to begin with the solid mesh for all components, I will convert all beams into solids. I will multiple-select the beams; right-click and select “treat selected bodies as solids”. All bodies in the model are now treated as solid mesh components.\nI mentioned earlier that in this first part I will only focus on the frame, so I will exclude the four gussets from analysis. I will also exclude from analysis the drip tray lug parts.  ▲ I will keep the feet plates as this allows me to easily define the frame connections to the ground.', '0', '0');
INSERT INTO `cuepoints` VALUES ('5', '194', 'CH', 'Loads', '333', '459', '1', '\nNow, there are various locations at which the loads caused by the pipings are transferred into the frame. I already have the split faces defined at such locations throughout the frame; for example these three split faces on the top flanges of the frame members. The load definitions are going to be straightforward in this model. I will assume that each split face location carries a vertical load mass of forty kilograms [40kg]. This assumption is not far from the real loads at these locations. I will enter the force property manager, select the metric as the unit system, and specify the load magnitude of forty kilograms [40kg]. I will keep the “per item” option, and select all split faces where the piping lies on the frame. I will pin the force property manager because I have more loads to define, and click OK. [PIP Split faces]  You can see that the split faces are larger than the real contact area, occasionally enclosing contacts for two neighboring pipes. Such simplifications introduce only negligible errors in this case.\nI will continue with the load on the ▲ top left beam. This beam supports three pipes spread out on the beam. Here, I will again assume that the load can be distributed uniformly, over the whole beam length. I will therefore specify a hundred and twenty kilogram [120kg] load acting on the top flange of this beam.\n\nConsidering the weight and length of the frame, I will also define a vertical gravity load of nine point eighty one meters per second square [9.81 m/s2].', '0', '0');
INSERT INTO `cuepoints` VALUES ('6', '194', 'CH', 'Fixtures', '459', '488', '1', '\nThe fixtures are easy in this simulation. The floor mounting plates are bolted to the ground. Because I am not interested in the feet plates themselves, I will assume that fixing them will provide correct model behavior. I will apply fixed geometry fixture to the bottom face of each pad.', '0', '0');
INSERT INTO `cuepoints` VALUES ('7', '194', 'CH', 'Contacts, Mesh #1', '488', '551', '1', '\nNext on the list are contacts. Because all members are properly trimmed and touching, global bonded contact will take care of all bonds. However, as you will see shortly, some bonds may not get established automatically.\nI can now mesh the model. Because this model features small geometrical features such as the member corner fillet, I will use the curvature mesher. I will specify a hundred millimeters [100 mm] for the maximum element size. The minimum element size will be set to twenty millimeters [20 mm], which is ok. I will keep the rest of the mesh parameters at their default values. The meshing process takes about a minute to complete. The solid mesh features approximately five hundred and thirty nine thousand nodes [537,000]. I will not spend any time on the mesh quality review because the mesh is still quite coarse.', '0', '0');
INSERT INTO `cuepoints` VALUES ('8', '194', 'CH', 'Solution', '551', '560', '1', '\n Running this solid study takes only about a minute and a half [1.5 min].', '0', '0');
INSERT INTO `cuepoints` VALUES ('9', '194', 'CH', 'Solids - Displacements', '560', '604', '1', '\nI will first review the displacements. The maximum displacement of two point seventeen millimeters [2.17 mm] is found in the top left member. This is well below the requested limit of five millimeters [5mm]. △  But there is a problem. Notice, that the vertical web of the member seems disconnected from the upright. The beam is connected to the joint only through its top flange. The bonding is clearly not working as anticipated at this location. This inaccuracy has a significant impact on the stiffness of the beam, and of the whole frame, and must therefore be corrected.', '0', '0');
INSERT INTO `cuepoints` VALUES ('10', '194', 'CH', 'Contacts - Bonding', '604', '788', '1', '\n\nI will hide the displacement plot and explain to you what happened here. The cad model features gaps between the vertical flange of the beam and the upright. In a real structure, this gap is of course filled with the connecting weld, but the simulation model does not have this information. Because global contact only considers touching faces, it does not consider this location for bonding, and leaves  ▲the two faces here disconnected. Global bonding therefore successfully established the bond only on the ▲ top, where the flange touches the flat face of the upright. To create a correct simulation model, the vertical flange must be connected to the upright manually using the local bonding. I will therefore right-click on the connections folder and select contact set. I will change the type to “bonded”; select the three side faces of the upright in the first selection field, and the end face of the horizontal member in the second selection field. It is not important which set of faces is selected in the first, and the second selection field. Same bonding should be defined for all similar connections, and as you can imagine this would be quite a tedious task. I will make the following assumption. This phenomenon is really significantly affecting the angle profiles only. Here, for example, I have a square profile connected to the upright. Square profile features two vertical gaps, one on each side, ▲ but its cross-section touches the flat face of the upright on the top and on the bottom. And so its connection to the joint uses two out of four segments of the square cross-section. This is a stiff enough connection to the joint for our purposes in this simulation. I will therefore only create the remaining local bonds for much weaker angle profiles. I will go back to the local contact definition, set the type to bonded, pin the property manager, and go ahead with the definitions for all engle profiles. When done, I will have defined ten [10] local bonded contacts correctly bonding the engle profiles to the uprights.', '0', '0');
INSERT INTO `cuepoints` VALUES ('11', '194', 'CH', 'Mesh #2, Solution', '788', '817', '1', '\nOK. I am now ready to remesh the model with the same mesh settings. And I can go ahead and launch the solution. It again takes only about a minute and half [1.5min] to complete.', '0', '0');
INSERT INTO `cuepoints` VALUES ('12', '194', 'CH', 'Solids - Displacements', '817', '871', '1', '\nI will again review the displacements first. The maximum value is of course in the same top left member, but it dropped by nearly thirty five percent [35%] to one point forty two millimeters [1.42mm], well below the design limit of five [5] millimeters. Now, ▲ the displacements are shown in the magnified scale, so the shape in the middle of the top left member is somewhat distorted. I can ignore that. But if I zoom on the same joint, I can see that it is now bonded correctly. The entire end face of the angle cross-section is now bonded to the upright, and so the joint behaves as expected. Also, ▲ the members in the middle of the frame recorded deflection of less than one millimeter [1 mm].', '0', '0');
INSERT INTO `cuepoints` VALUES ('13', '194', 'CH', 'Solids - Stresses', '871', '0', '1', '\nI can go ahead and review the stress results. I will edit the chart options, and activate the max annotation. The maximum stress in the model is ninety five point one megapascals [95.1 MPa] located, not surprisingly, in the left joint of the top left member which carries the most load. △  This value is below the design limit of a hundred and fifteen megapascals [115 MPa]. Also ▲ notice how the stress transition to the upright along the entire vertical flange of the angle member. As you know by now, these results would have to be converged, but because I only want to establish reference results, I am ok with this solution. I will now probe the stresses in the middle of this member. The tensioned bottom side of the angle member reached about thirty four megapascals [34 MPa]. The top, or the compressed side, recorded a little less than eighteen megapascals [18 MPa]. \nThe middle front member recorded eighteen point five megapascals [18.5 MPa] on the top, or its compressive side; and about the same on the bottom, its tensile side. Ok, these results provide a good reference, and I can go ahead and analyze this frame using the beam mesh.', '0', '0');
INSERT INTO `cuepoints` VALUES ('14', '202', 'CH', 'Introduction, Agenda', '0', '53', '1', '\n\n[INT L6.1.2 Introduction] \nThe second part of this beam mesh lesson covers the basic concepts. The duration of this part is approximately twenty eight minutes [28 minutes].\n\nIn this part I will use beam elements to solve the same acid dosing skid frame.\n\nThe purpose of this part is to introduce you to the basics of working with beam mesh. I will introduce you to the beam element type. You will learn about the beam joints, how they are created, and how they are affected by the geometry of the underlying cad model. You will see how a beam mesh is displayed, and how it differs from the solid mesh or shell mesh. I will show you how to apply fixtures and loads, and some basics of the beam postprocessing. Beam postprocessing can be a little more involved, so separate parts are dedicated to this topic later on.', '0', '0');
INSERT INTO `cuepoints` VALUES ('15', '202', 'CH', 'Beams study', '53', '165', '1', '\nI’ll first create a new static study and name it “beams” [beams]. Similar to the previous solid study, I will exclude from analysis the gussets; the drip tray lugs; and this time also the feet plates.\n\nNext, I’ll check that all members are treated as beams. Typically, structural members created using solidWorks weldments toolkit are automatically recognized as beams. But  notice that some of the members in the folders that I have just expanded are treated as solids. ▲ This is due to the split faces used in the previous solid study created on faces of these structural members. Pretty much the rest of the members are treated as beams. Now, because I want the beam mesh in the entire frame, the members treated as solids have to be changed into beams. I will therefore multi-select all frame members currently treated as solids; right-click on them and select “Treat selected bodies as beams”. All bodies in the tree are now treated as beams, identified with the beam icon next to them.', '0', '0');
INSERT INTO `cuepoints` VALUES ('16', '202', 'CH', 'Beam element', '165', '286', '1', '\nBefore I proceed with the study setup, let me now give you some basic information about the beam element.\n\n\n\n\n\n[Beam element definition]\nBeam elements are structural line elements. △  We call them structural because they represent a specific structure. Here, you have a long body with small cross-section. I can mesh it with solids, but this takes a lot of elements into the solution, so it is highly ineffective. In this example I created sixteen thousand [16,000] solid nodes. Beam element is far more efficient in this situation, it is just a straight line with only two [2] end points, so the meshing and solution is extremely fast. The beam elements carries with itself all cross-sectional properties as parameters, which are derived from the real geometry and are of course used to correctly assemble the elemental stiffness matrix. \nEach beam element has only two endpoints at its ends, and each end point then features six [6] degrees of freedom, three [3] translations and three [3] rotations. Beam element can translate, bend, and it can also twist under the torsional loads.\n\nThere is one thing that you need to remember. To correctly use beam elements, your structural bodies must be slender, that is long and having a small cross-section. A rule of thumb here is that the length to the cross-section height should be at least ten [10] or more. As this ratio gets smaller, accuracy of the beam elements will progressively degrade.\n\nAs mentioned before, when a designer uses SolidWorks Weldment Toolkit, the weldment bodies are by default treated as beams in SolidWorks simulation. You can always change this and treat the weldment members as solids, and vice versa. Extruded bodies or even swept solid bodies with uniform thickness are by default treated as solids, but you can treat them as beams by right clicking on them and selecting the “treat as beam” option.', '0', '0');
INSERT INTO `cuepoints` VALUES ('17', '202', 'CH', 'Joints, Neutral axis', '286', '604', '1', '\n△  The next step is generation of beam joints. ▲Notice that the default joints were already generated automatically, but because some frame members were changed from solids to beams, new set of joints must be generated. I will right click on the folder titled ‘joint group”, and select “edit”. This step is one of the most important in preparation of the beam mesh. SolidWorks simulation greatly simplifies this step, and in most situations, automatically generates the correct joints. I will keep “all” in the first field, meaning that joints will be re-calculated for all frame members. △  I will also keep the rest of the options at their default setting. ▲The “treat as joint for clearance” option is set to “equal to zero”, or “touching”. This means that only touching members will be considered as candidates to be connected to a joint. △  I will also check “display neutral axis”. Neutral axis is a fundamental line because it represents the true location of the beam line mesh. I will now zoom on one of the joints so that the neutral axes are more visible. ▲You can clearly see the lines representing positions of the beam line elements. Notice that all neutral axes coming to this joint, however, do not intersect at it. ▲These two neutral axes, representing the upright members, intersect right at the center. ▲ But the remaining three [3] are terminated before reaching the intersection. This is caused by the underlying three d [3D] geometry. ▲The upright members are passing through, ▲while the other three [3] members are terminated with a butt end.\n\n\n\n\nI will remind you of this later when discussing the joint formation in detail. Similar situation is at almost all of the other joints. Some neutral axes will extend all the way to the center, while the others will be terminated before reaching the center. For example at this location, ▲the horizontal neutral axes are passing through ▲ while the remaining two are terminated;\nor at this location, ▲where the neutral axis for the upright terminates at the joint, while the remaining two for the horizontal members terminate close to it. Notice also, that here the joint is not located at the geometrical center, as could be expected, but at the end of the upright neutral axis. You can see that the location of the joints, and the ends of the neutral axes for the beams is clearly driven by the underlying geometry of the cad model.\nOK. I will now click calculate to see the new proposed joints solution. Before continuing with joints, however, I need to explain to you how to correctly understand them. \n\n\n[Joints] △\nIt is fairly easy to confuse the beam mesh joint with the beam end point. The easiest way to understand this, is to first introduce a structural joint using the solid cad [CAD] geometry. In this example, we have four beams coming out from the joint. You can also understand this as four beams connected to the joint. In any case, you need to view the beams and joints as separate entities: beams as components terminated here, each having two end points; and then the joint as the complex welded part in the middle. In the beam mesh you would only see the four lines representing four beams. But here you also have to view the beams, and the joint as separate entities, with the exception that the beam elements extend all the way into the theoretical location of the joint. The joint is therefore very small, and its location coincides with the locations of the beams’ endpoints. They are, however, still separate entities. At times, users confuse the joint and the beam end points. Beware of this misconception from now on. It may lead to confusion later when working with more complex beam assemblies, where modification of degrees of freedom at beam endpoints is required in order to control the way the beam connects to the joint.\n\n\n\n\n\n\nOK. △  Beam joints in SolidWorks simulation are shown as either yellow or magenta spheres. ▲Yellow joints are those, that are connected to only a single beam; free ends basically. All  yellow joints in this model are on the bottom of the uprights, because no other beams are connected to them.\nThe magenta coloured joint represents a joint connecting two or more beam members. △ To view what beams connect to a specific joint, I can right-click on it while the edit joints property manager is open. For example, I will right-click on this magenta joint and see that it connects three members highlighted in the graphics view. I can easily remove one from the selection, or add another one back to it, but I will not do it for now.\nI will save the new joints. The warning window informs me that the joints may look the same, but because I recalculated them their numbering can be different. I will click OK and dismiss this warning.', '0', '0');
INSERT INTO `cuepoints` VALUES ('18', '202', 'CH', 'Beam mesh', '604', '689', '1', '\nNow that you understand the beam elements, and their joints, I can go ahead and generate mesh. Here, you will begin to appreciate the efficiency of these elements. The mesh completed in a fraction of time as compared to even the coarse solid mesh used in the first study. While preprocessing beams and their joint creation may take some time, mesh generation and calculation is extremely efficient. \n△  In SolidWorks Simulation, beam mesh is represented by slender circular pipes instead of lines for better visualization. Remember, pipes in the mesh display do not indicate that the cross-sections are circular. Pipes are used for visualization of the beam mesh by default, irrespective of what the real cross-sections of the beams are.\n\n\n\nHowever, if you prefer, and if you don’t mind a slower response, you can display the beam mesh with its real profiles. I will right click on the mesh and select “render beam profiles”. This will plot the same mesh using the real beam profiles for a better visual reference. I will turn this view off for now, because it may slow down the system performance a bit.', '0', '0');
INSERT INTO `cuepoints` VALUES ('19', '202', 'CH', 'Joints in Beam mesh', '689', '876', '1', '\n\nI will now zoom on a few joints, this one first, for example. Notice that this intersection contains black connecting pieces. I will zoom onto another joint, where the situation is the same; black connecting pieces are added to the mesh. These black connecting pieces are important elements in the beam mesh. I will zoom again onto this connection; and edit the joints again. I do not want to re-calculate them. I am only editing them to see the neutral axes. \n\n△  I already discussed the fact, that because SolidWorks Simulation generates joints based on the three D [3D] geometry of the frame members, neutral axis of all connected beams seldom intersect at one point. Here, for example, the software places the theoretical joint to the endpoint of the neutral axis of the horizontal member. But the endpoints of the other three neutral axes terminate  ▲ here. Their endpoints are therefore somewhat away from the joint position. This is not ideal, but it is the only way to convert three dimensional geometry into a line mesh for members terminating at various positions and configurations. To complete the mesh and tie the beam endpoints to the joint, software adds connecting rigid bars.\n\n\n I will close the “edit joint” property manager, and show the mesh with the added rigid bars again. As you can see, this way the rigid joint actually gets some physical dimensions and resembles the real joint more realistically. The effect of the rigid bars on the solution is very small provided all guidelines for the beam mesh are followed. \n\n[INT Untrimmed beams] An alternative, and also more traditional way of preparing the cad geometry for meshing with beams is to use members that are not trimmed at the joints. In this example, all four members extend all the way to the intersection of the underlying sketch lines. Because all four members are square hollow sections, their neutral axes coincide with the sketch lines, and the joint can be placed right at their intersection. The resulting beam mesh then does not need to feature any rigid bars. Now, while this alternative, and a more traditional approach will typically result in a cleaner beam mesh, you will most likely face the original configuration with the trimmed members more often. It will therefore be more common. If the beam mesh joints are designed correctly, and the rigid bars are small relative to the sizes of the connected beams, both approaches will provide very similar results.\n\nGeneration of joints is a fundamental step in preparation of a beam mesh. In most situation, SolidWorks Simulation will automatically calculate all joints correctly, making the whole process very easy. However, there are situations where more work to generate correct joints will be necessary.', '0', '0');
INSERT INTO `cuepoints` VALUES ('20', '202', 'CH', 'Load ', '876', '1139', '1', '\n△ Ok. I now need to replicate the same loading scenario as defined in the solid coarse study. In the solid model, forces were defined on split faces, which was very convenient.  [PIP Split faces - forces in beams]  In beams, forces cannot be defined in the same way. In beams, isolated forces can only be define at joints, or at reference points created along the beams. Distributed forces can be defined as well, but only across the entire length of the beams.\n\n[PIP Forces on beams] \nI will first define isolated forces using reference points. I will show the reference points. The reference points were created beforehand at the locations where the piping connects to the frame. These are the same locations, where I created split faces for the solid mesh model. Because I will have to select the reference points, I find it useful to turn on the selection filter; and activate it for points. I will select all reference points; deactivate the selection filter and select the top plane for the direction. I will change units to “metric”, activate the third force field for the normal-to-plane direction, and enter forty kilograms [40 kg]. I also have to reverse the direction of the forces to have them point downward. I will pin the force property manager and click OK to save the definition.\n\n▲The top left beam has a uniformly distributed vertical force of a hundred and twenty kilograms [120 kg] applied over its entire length. So I will select “beams” to identify the selection entity type, select the top left beam, specify again the top plane as a direction reference, and define a hundred and twenty kilogram [120 kg] force in the downward direction. The default distribution is uniform. The beam elements however support non-uniform distributions as well.\nTo show you these options, I will now check the nonuniform distribution checkbox. You can quickly change the distribution type to triangular, parabolic or elliptical. ▲Typically you would be using the total load distribution, it is also the default choice. Here, the magnitude specified represents the total load. Centered load distribution implies that the magnitude represents the maximum value in the distribution, ▲ hence the maximum in the distribution parabola increased. If none of these options fits your distribution, use the table driven load distribution. I will keep it as uniform for this case, and so I will uncheck the non-uniform distribution checkbox, and click OK to save the definition.\n\n[PIP Solid long pipe split face] This side beam has a pipe running along the length of the beam.  In the solid coarse study, I defined the load on a long split face. As you know by now, I do not have this option in beams. I have two options. I can define the load distributed over the whole beam length. But that is not as straightforward here. The member extends all the way across the length of the frame, and so I am not going to be able to select just this portion of it unless I split the member in the cad model. I do not want to do that now. I will therefore split the total load, and define it at these two end joints. \nI will select “joints” to identify the selection entity type; and select the two joints. I will again select the top plane as my direction reference; and enter twenty kilograms [20 kg] in the vertical direction. Twenty kilograms [20kg] here means per joint, so this makes up a total of a forty kilogram [40 kg] load from the pipe.\nLastly, I will also define the gravity load of nine point eighty one meters per second square [9.81 m/s2] in the vertical, downward direction.', '0', '0');
INSERT INTO `cuepoints` VALUES ('21', '202', 'CH', 'Fixtures', '1139', '1182', '1', '\n△ Similarly to solid model, I need to fix the feet of the frame. I will enter the fixed geometry property manager, and select the bottom eight yellow joints. Because the members are welded onto the ground pads, the fixed geometry fixture is the best approximation. It restraints all six [6] degrees of freedom, and thus fully fixes the feet. \n▲ This fixture group also contains the “immovable” and “use reference geometry” fixtures that can be applied to beam joints. Their function is the same as for solid and shell element types.', '0', '0');
INSERT INTO `cuepoints` VALUES ('22', '202', 'CH', 'Solution', '1182', '1197', '1', '\nI will turn off the reference points. I can now run the solution. Once it starts, it completes in a matter of a few seconds. This again demonstrates efficiency of the beam elements.', '0', '0');
INSERT INTO `cuepoints` VALUES ('23', '202', 'CH', 'Beams - Stress results', '1197', '1245', '1', '\nI’ll review the default stress plot first. ▲ The default stress measure for beams is a combination of axial forces and the worst bending moment. This stress measure is called “upper bound axial and bending”, and it represents the worst case situation for the normal stresses.” I will give you more information on the beam postprocessing later in this lesson, so for now I will just review the numbers. The maximum recorded stresses reached approximately a hundred megapascals [100 MPa] at the left end of the top left beam loaded with a hundred and twenty kilogram [120 kg] distributed load. This compares rather well with ninety five point one megapascals [95.1 MPa] obtained from the solid coarse study.', '0', '0');
INSERT INTO `cuepoints` VALUES ('24', '202', 'CH', 'Beams - Displacement results', '1245', '1501', '1', '\n\nI will now look at the displacements. I will first edit the chart options and activate the max annotation. ▲ The maximum for the model globally, zero point seventy seven millimeters [0.77 mm] shifted to the middle two beams. I will also check the top left beam. Based on the colors, its deflection is approximately zero point six millimeters [0.6mm]. Now, this result is different from the solid study, which gave one point forty two millimeters [1.42 mm] at this location. Why is there such discrepancy in the displacements at this location? The answer lies in the application of the force and the geometry of the structural member, in this case an angle profile. \n\n△  [PIP Effect of twisting] In solids, I applied the force over a split face on the top flange. The centroid of the cross-section is located here. The second important location for the cross-section is the shear center, located right here where the two flanges meet. A detailed explanation of the shear center goes beyond the scope of this lesson. What is important for us now, however, is the fact that the distributed load applied on the top flange inevitably creates the torsional moment. \n\nBecause the angle profile is not particularly stiff at resisting torsion, it twisted. This twist was added to the deflection due to bending, hence resulted in a higher resultant deflection from the solid model. For the beams, on the other hand, the force was defined as uniformly distributed load over the beam length. It is commonly assumed that for beams this load passes directly through the shear center, or in other words, it is assumed that the torsional effect of the load due to its distribution over the cross-section can be ignored. This made the member modeled as beam stiffer, and as a result it deflected less. This member therefore displaced only due to bending, but no twisting, and its deflected position and orientation is somewhat different from the solution with solid elements. \nIt is important that you correctly understand the cause of this phenomenon, so I will rephrase it quickly again. The inaccuracy in the beam solution is not because the beam elements cannot handle torsional loads correctly. Beam elements are actually capable of handling complex torsional loads. The discrepancy was caused by the assumption that distributed loads applied on beams pass through the shear center, thus ignoring the torsional moments caused by this load. \nIn typical beam applications this inaccuracy does not pose a lot of problems, because as the beam length grows, the bending deflection becomes dominant. In our model the deflection of the beam is very small, only zero point six millimeters [0.6 mm]. And this represents only about zero point one percent [0.1%] of the beam length. Also note, that this effect is inherent only to asymmetrical cross-sections such as this angle profile. Symmetrical cross-section such as squares do not suffer from this phenomenon.\n\nIt is also interesting to compare the number of elements and times required to solve the simulations.\n\n[PIP Calculation times]\nThe solid coarse mesh required one minute [1 min] to complete meshing of the frame with almost five hundred and thirty seven [537,000] nodes, whereas the beam mesh took less than five seconds [5 s] and created less than sixteen thousand and two hundred [16,200] nodes. The difference in the mesh sizes is huge, and the same goes for the calculation times. Solid coarse mesh took one and a half minute [1.5 min] to complete, whereas the beam mesh finished in a couple of seconds. Again, these numbers clearly demonstrate efficiency of the beam mesh. It provides results in fraction of time required for solids. Also, you need to view these numbers in context of this problem, which is relatively small. While one and a half minute [1.5 min] for the solid model is not too long in this problem, more complex models may run many hours, or even days. Efficiency of beams in such situation is essential.\n\nThis completes the first part of this lesson, which gave you a basic introduction to the beam element and its application.', '0', '0');
INSERT INTO `cuepoints` VALUES ('25', '202', 'CH', 'Summary ', '1501', '0', '1', '\n[INT L6.1.2 Summary] In the first two parts of this beam lessons you \n In this lesson you learned basic information about beam elements. I applied beam elements to simulate the frame supporting the acid dosing skid. \nI first solved the problem using solid elements, only to establish the result reference, without paying much attention to the mesh quality. The solid element model generated over a half a million nodes, and took about a minute and a half [1.5 minute] to solve. The specifics of the solid mesh model was bonding of the angle profile to the uprights. The cad geometry featured gaps between the vertical flanges and the uprights. While these gaps are in reality filled with connecting welds, a simulation model does not have this information defined explicitly. Global bonding therefore did not recognize this interface as bonded contact, and the solution at the joints was not correct. The bond only formed on the top where the flanges of the angle profile and the vertical upright touch. To resolve this, I had to define local bonded contacts between the end face of the angle profiles, and the uprights. The solution of the joint was then correct.  \nI then went on building a simulation study with beam elements. SolidWorks Simulation treats weldment parts as beams by default, as indicated by the corresponding beam icons. In this case a few weldment members were treated as solids. This happened because I had split faces on them. I had to convert them into beams first. I then introduced you to the beam element definition, its advantages and the degrees of freedom at its endpoints. Next, I talked about joints connecting the beams. I explained to you that you need to look at joints and beams as separate entities. I introduced to you a concept of the beam neutral axis, which represents the real position of the beam line element in the mesh. Because endpoints of the neutral axes seldom intersect at one point, simulation adds black rigid bars in the beam mesh, connecting the endpoints to the joint. The beam mesh in simulation is by default visually represented with pipes. You can also show the mesh with the rendered beam profiles. I also talked about two types of joints: magenta joint, and yellow joint. Yellow is connected to only a single member, which practically means the endpoint. Magenta joint is connected to two or more beam members.\nI then showed you how to apply load on the beam mesh. It is not exactly the same as in the case of solids and shells. In beams, you can apply loads at reference points created beforehand, or at the joints, or as a distributed load along the entire beam length. Fixtures were easy. I only applied fixed geometry fixture on the bottom yellow joints representing the feet bolted to the ground. I then post-processed the results, and focused on the displacements of the top left beam. This beam study reported results much smaller than the solid mesh study. I explained that the additional displacement in the solid model was caused by the torque of the load distributed on the top flange. In beams this effect of the load is ignored. It is typically ok for longer beams, because bending is the dominant component of the deflection. We also compared the times required to solve the simulations using the beam and solid elements. The beam mesh solved the same simulation in a fraction of time as compared to solid elements.', '0', '0');
INSERT INTO `cuepoints` VALUES ('26', '210', 'CH', 'Introduction, Agenda', '0', '35', '1', '\n\n\n[L6.1.3 INT Introduction - Advanced topics] \nThe third part of this beam mesh lesson will begin to introduce you to more advanced concepts. It will mainly focus on connections. The duration of this part is approximately eleven minutes [11 minutes].\n\nThe following part will continue with a simulation of the acid dosing skid frame using the beam elements. Because gusset plates and similar components are very common in frames, I will show you how to add these components to the beam mesh model. I will also teach you how to control the connection of a beam member to the joint.\n\n[OLD The following lesson will continue with a simulation of the acid dosing frame using beam elements. I will explore more details about the beam analysis. I will discuss beam definition and directions, available stress measures, various post-processing tools, and towards the end I will show you a simplified validation procedure. The material presented in this part of the lesson is more advanced. It is assumed that the viewer is familiar with the basic concepts of the beam element theory. Introductory users may find this part of the lesson somewhat challenging, and are encouraged to consult their instructors.]', '0', '0');
INSERT INTO `cuepoints` VALUES ('27', '210', 'CH', 'Element selection', '35', '88', '1', '\n\nI will duplicate the existing beam study and call it “Beam-fine with solids”. △  In this study, I will also include the corner gussets in analysis. They are very common in frames and I have to teach you how to properly include them in your mesh. [PIP Gussets as solids] Gussets will be meshed with solid elements, and so this study will combine solid elements for gussets, and beam elements for the frame. This type of meshing is called mixed meshing. Mixed mesh topic is treated in detail in another lesson.', '0', '0');
INSERT INTO `cuepoints` VALUES ('28', '210', 'CH', 'Beams & Gussets - Bonding, Mesh', '88', '365', '1', '\n\nOk. I’ll now refine the mesh along ▲ these six [6] beams which are joined by the gusset parts. I will click the beams button to specify the input type, and select the six beams. I will define forty [40] elements per each selected beam. \nIn general, you don’t need to refine the beam mesh unless the beam is subjected to a complex loading, or it is bonded to solid or shell parts, as is the case here. △  [PIP beam to gusset bonding] To reliably bond the solid cross-section of the gusset plate to the beam, you need enough beam nodes to project on the gusset cross-section. For example, with the default mesh settings, I would only generate five [5] beam elements along the side beam. That means that only these two beam nodes would project onto the gusset cross-section to form a bond, effectively leaving this area of the gusset disconnected. The stiffness of this bond is much smaller than the stiffness of the real welded connection. With the default mesh control generating ten [10] beam elements, the connection improves significantly. I now have four [4] beam nodes projecting onto the gusset cross-section. With forty [40] beam elements the situation improves significantly yet again. Here I have fifteen [15] beam nodes connecting to the gusset cross-section. I can comfortably assume that this density of the beam nodes provides the bond correctly simulating the real welded connection. Introducing even more beam nodes would not improve the situation noticeably.\nI will go ahead and mesh the part. I will reset the default mesh size; and keep the standard mesher. Note that now I have beam elements for the frame, and solid elements for the gussets. \nAs mentioned a moment ago,▲ the gusset plate is bonded to approximately fifteen [15] beam nodes on this side, which is more than enough to model a proper welded connection. ▲ On the other side I have about six [6] nodes projecting onto the gusset cross-section. This is also enough to form a proper connection.\nThe next item is bonding. As you begin mixing various types of meshes in your simulations, you will realize that global bonding often does not recognize interfaces, where beams bond to solids or shells. In these situations the global bonding often fails to bond them, and manual local bonding sets are necessary. So I will now go ahead and bond the beams to solid gussets manually. I will open the contact set dialog box, select bonded as type; click beams to specify the input field element type, and pin the property manager. I will select the first short beam on the left in the first selection field, and the corresponding gusset cross-section face in the second field. I will repeat this for the second bond on the same gusset plate. I will now repeat these steps for the remaining three gussets. OK. I have created a total of eight contacts for four gussets plates.', '0', '0');
INSERT INTO `cuepoints` VALUES ('29', '210', 'CH', 'Beam connection to joint', '365', '648', '1', '\n\nIn the next section I will teach you how a beam element connects to the joint. I already explained to you how to regard joints. Joints must be viewed as structure separate from beams, with beam endpoints being connected to them. I will now edit definition of this beam. First, note that each beam endpoint is identified with a different color, red and blue. Secondly, ▲ note that by default each endpoint, the red on the right side and the blue on the left side, is fully tied, or rigidly connected to its respective joint. The connection of each endpoint to the joint can be modified. You can select from a hinged beam, a sliding beam, or specify the endpoint connection manually. △  [PIP Beam connection to joint]   The hinge allows the beam endpoint to rotate, but it will remain connected to the joint. Here, the left endpoint connection is set to hinge, and so it rotates at the joint. The right endpoint is left at the default rigid setting, and you can see that it is fully connected to the joint. The second animation is demonstrating the slide option set at both end points. Notice that▲ the endpoints are sliding up and down out of the joints, but they do not rotate. The rotations are tied to the joints.  The last option, “manual”, gives you a full control because it allows you to activate and deactivate each degree of freedom of the connection manually. You will see how it is done in a moment. For now I will change the connection type for the red endpoint back to rigid. After all, for most frames, beam endpoints are typically rigidly connected to the joints. However, situations do exist, where this connection must be edited.\n\nThe type field allows you to switch from beams to truss element type. Truss element is in essence the same as beam element, with its endpoints connected to the respective joints as hinges. \n\n\n [PIP scaffolding] For example, the following connection between the scaffolding standard and bracing ledgers. This hinged connection does not provide sufficient rotational stiffness and so the endpoints of the ledger beam are not rigidly connected, but instead may rotate about the horizontal member.\nAnother example could be a faulty, cold weld, where you may want to investigate the effect of a bad weld not capable of transmitting moments. I will demonstrate this procedure in this lesson. \n\nI will assume that the specifications require to assume a faulty connection of this beam’s blue endpoint to the joint; a cold weld perhaps. Now, if I assumed that the blue endpoint can freely rotate at the joint about all three axis, ▲  I would have selected a hinged connection. To show you a more challenging configuration, however, I will assume that the faulty weld allows the beam endpoint to rotate only about ▲ this axis, while still retaining its ability to transmit moments about the remaining two axes. I will therefore set the end connection type for the blue endpoint to “manual”, and set each degree of freedom individually. Before doing so I also have to check the “show beam direction” checkbox, to display a triad indicating the local directions for the selected beam. Notice this triad displayed in the middle of the edited beam. ▲ The green arrow indicates the local beam direction one [1], ▲ and the blue arrow indicates the local direction two [2]. ▲The red arrow, barely visible in this view, is always directed along the axial direction of the beam.   \nThis triad will now help me to correctly set the connection degrees of freedom. I will assume that the connection cannot transmit moments in the green direction one [1]. To do that, I will check “hinge direction one” [1]. This means that this beam endpoint can now rotate about the blue direction two [2], thus deflecting more significantly in the green direction one [1]. The remaining five [5] degrees of freedom remain of course tied to the joint. The red endpoint remains rigidly connected to the joint. I will turn off the beam directions, and close the edit beam dialog. Now that I modified the endpoint connection settings I have to remesh the model. I will keep the same mesh settings as before.', '0', '0');
INSERT INTO `cuepoints` VALUES ('30', '210', 'CH', 'Solution', '648', '0', '1', '\n\nThe meshing is very fast.  Running the simulation is again very fast, even though I included the solid gusset plates.', '0', '0');
INSERT INTO `cuepoints` VALUES ('31', '218', 'CH', 'Introduction, Agenda', '0', '54', '1', '\n\n[INT L6.1.4 Introduction] \nThe fourth part of this beam mesh lesson covers stresses in beams. The duration of this part is approximately seventeen minutes [17 minutes].\n\nThe following part will continue with a simulation of the acid dosing skid frame using   the beam elements. This time, I will focus on how to postprocess the results. To successfully use beam elements, you need to get familiar with their stress measures and how they are plotted. You will see that postprocessing beam results is not exactly the same as postprocessing results from the solid mesh. The material presented in this part of the lesson is more advanced. It is assumed that the viewer is familiar with the basic concepts of the beam element theory. Introductory users may find this part of the lesson somewhat challenging, and are encouraged to consult their instructors.', '0', '0');
INSERT INTO `cuepoints` VALUES ('32', '218', 'CH', 'Results - Displacements', '54', '141', '1', '\nIn this last section, I will look deeper into the beam post-processing. I will first turn the simulation symbols off; and review the displacements. The maximum displacement increased from zero point seventy seven [0.77mm] millimeters to about one point nineteen millimeters [1.19mm]. It is expected, because  ▲ the middle beam is not fully tied to the joint at its left endpoint, hence it must have deflected more. Notice that the left endpoint rotated at the joint. This degree of freedom was released earlier for this endpoint. The other side of the beam remained fully tied to the joint, and so the beam remained rigidly connected to it.\nNotice also, that the gusset plates are correctly bonded to the beams and the deformation is continuous.\nI will now look at stresses. By default, stress results for solid elements are shown and so this plot only shows stresses for the four gusset plates. In this lesson I will ignore the stress results in the solid gussets, and focus on the beams only.', '0', '0');
INSERT INTO `cuepoints` VALUES ('33', '218', 'CH', 'Beams - stress types', '141', '720', '1', '\nBefore showing the stresses and drawing the conclusions, it is necessary to give you an introduction to stress measures in beams. △  [Stress types in beams] I will use the following model of a cantilever beam with a rectangular cross-section, loaded by a combination of forces at its end. I am using a rectangular cross-section because it is a classical case, and it is easier for the purpose of discussing stresses in beams. A combination of forces shown here will cause fairly complex stress distributions across the cross-section, and so I will take it step by step.\nThere are two types of stresses in the cross-section of a beam. Normal stress denoted with Greek sigma, and shear stress denoted with Greek tau. I will begin will the normal stresses, stretching or compressing various parts of the cross-section. An axial force will cause uniformly distributed normal stress in the cross-section. We call this stress axial, and it can either be tensile or compressive. Tensile stress is always denoted with a positive value, compressive stress then with a negative value.\nThis loading moment, and also this vertical force will together cause the following linear distribution of the normal bending stress. It reaches the largest magnitudes at the extremities of the cross-section, here the maximum compression on the top, the maximum tension on the bottom, and it is zero along the cross-section neutral axis for this loading. Again, a positive value denotes tension, a negative value denotes compression.\nSimilarly, this loading moment, and this horizontal force will cause similar linear distribution of the normal bending stress, but in the perpendicular direction. The maximum values are again at the ends of the cross-section, and zero along the cross-section neutral axis for this loading. Tension is again positive, compression is negative.\nBecause normal bending stresses are caused by forces and moments acting in two perpendicular directions, we need to distinguish between them by referring to them as the normal bending stress in direction one [1], and normal bending stress in direction two [2].\nHere you can see all three normal stresses plotted next to each other. Notice that they all are  oriented in the same direction normal to the cross-section, and so they can be summed. We often referrer to their sum as the total normal stress. The resulting distribution of the total normal stress is of course more complex. There would typically be one point at one of the corners of the cross-section, which would be exposed to the largest total normal stress. SolidWorks Simulation reports all three normal stress components, as well as their sum. \n\nNow, let’s look at shear stress tau, shearing the cross-section of the beam. First, I will look at the transverse shearing stresses caused by this vertical and this horizontal force. This vertical force will cause the following transverse shear stress across the cross-section. It is of course oriented vertically, and its magnitudes for this rectangular cross-section follow the parabolic distribution. They are zero on the top and on the bottom, and maximum in the middle at the cross-section neutral axis for this loading.\n\n\nSimilarly, this horizontal force will be responsible for the transverse shear stress in the perpendicular direction, again with zero values at the extremities on the left and right sides of the cross-section, and the maximum at the cross-section neutral axis for this loading.\nNow, identically to the two normal bending stresses, transverse shear stresses are caused by forces acting in two perpendicular directions. We refer to them as the transverse shear stress in direction one [1], and the transverse shear stress in direction two [2].\nThe last stress component is called torsional shear stress, and it is caused by the loading torque. This shear stress rotates about a special point called “shear center”. Because the rectangular cross-section used in this example has two axes of symmetry, the shear center coincides with the cross-section centroid. The torsional shear stress follows this distribution for the rectangular cross-section. It is zero at the shear center, and it peaks at the extremities of the cross-section.\n\nSimilarly to normal stresses, all shear stresses, meaning the two transverse shear stresses, and the torsional shear stress act on the same plane and can be summed to obtain the total shear stress. Unfortunately, it is not as straightforward. In this lesson, we will therefore use a simplified approach, where all three shear stresses will be summed in their absolute magnitudes, regardless of their direction and location in the cross-section. The maximum total shear stress in a cross-section will therefore be equal to the sum of the absolute values of the maximums for the transverse shear in direction one [1], transverse shear in direction two [2], and the torsional shear stress. This simplified approach provides a conservative value of the maximum total shear stress, and, as you will see, it is just fine for long beams where bending is typically dominant.\n\nLater in this lesson, I will show you how to use the maximum total normal and shear stresses to validate a beam profile.\n\nTo conclude this section, I also have to mention a few things about so called thin walled cross-sections, and their response to torsional loads. You certainly noticed that this frame is made from angle and square profiles with thin walls, and not from the solid rectangular cross-section. Torsional shear distributions in thin wall cross-sections are significantly more complicated, and so a more in-depth treatment of this topic goes beyond the scope of this lesson. However, because thin walled members are so common, I will tell you at least the following. The angle profile is what we call an open cross-section, while the square profile is called a closed cross-section. Clearly, you can guess that the closed cross-section profile will resist torsion much better than the open cross-section profile. Remember that. If you face a situation with significant torsional loads, try to use members with closed cross-sections rather than the members with the open cross-sections.\nThe last important comment is on the warping phenomenon. Most of the profiles loaded in torsion, especially the thin wall open profiles loaded in torsion, suffer from the cross-section warping. To demonstrate warping, I will use the following I-beam loaded in torsion. The deformed beam looks as follows, but let’s look at it from the side. This is the undeformed mesh of an I-beam, and this is its deformed twisted shape. I specifically included the reference plane at the right endpoint. When I zoom in onto this area, look at what happened. The cross-section that was initially straight and planar, is not straight and planar any longer. The top and bottom flanges twisted sideways. We say that the cross-section warped. This point moved to the left, while this point moved to the right. On the bottom it reversed. This point moved to the right, and this point in the back moved to the left. Now, most end cross-sections are of course welded to the joints or some stiff supports, and so their end cross-sections cannot warp freely as shown in this image. So let me show you what happens when such free warping is prevented. The twisted flanges are forced back to the planar configuration, which of course causes a lot of additional stress. This additional stress is called warping stress, and it has both normal and shear components. \nA more in depth treatment of warping is rather involved and goes beyond the scope of this lesson. But remember that the classical beam theory does not account for warping, and so it also does not account for the warping stresses it may cause. Torsionally loaded open thin wall profiles tend to warp significantly. If their warping is restricted, you should consider the warping normal and shear stresses caused by it. Their contribution can represent tens of percents. When significant torques are present, it is recommended to minimize their impact by a good structural design, use of closed cross-section profiles instead, and to increase the factor of safety. In extreme cases, it is recommended to model the members with shell or solid elements, instead of the beam elements.\nClosed thin wall cross-sections do warp as well, but significantly less than the open thin wall cross-sections. This is also why they should be your preferred choice in torsional applications. Their warping is often neglected, but the recommendations would still be the same. Minimize the impact of large torques by a good structural design, increase in the factor of safety, and if necessary, use shell or solid elements instead. \nSolid cross-sections tend to warp much less, and the circular cross-section does not warp at all.\nIf you wish to study this topic more, please consult your instructor for the additional study material.', '0', '0');
INSERT INTO `cuepoints` VALUES ('34', '218', 'CH', 'Results - Normal stresses', '720', '1004', '1', '\n\nI will now edit the stress plot; and select “beams” to show stresses for beams only. The default stress component for beams is “upper bound axial and bending”. [PIP Axial and Bending reminder] To remind you, this stress is equal to the sum of the axial stress, and the bending stress in direction one [1] and in direction two [2]. I will edit the legend and activate the display of the maximum and minimum annotations. ▲The maximum normal stress of sixty one point four megapascals [61.4 MPa] is still located in the top left beam, but the magnitudes have dropped significantly because of the stiffening gussets. I will now edit the stress plot, pin it, and show you the beam stress measures discussed a moment ago one by one. I will focus on the left endpoint of the top left beam. The first one is the axial stress measure. [PIP axial stress reminder] To remind you, the axial component identifies uniform normal tension or compression in the cross-section of the beam. In my case the maximum axial stress in this beam is a very small. ▲The orange contour corresponds to a tension of about zero point two megapascals [0.2 MPa]. The next two stress measures are “Upper bound bending in direction one” [1], and in direction two [2]. [PIP normal bending stress reminder] To remind you, the normal bending stresses in direction one [1], and in direction two [2], are peaking at the extremities of the cross-section. The result plots from SolidWorks simulation will show the maximum values from these distributions. I will first show “Upper bound bending in direction one” [1]. The left point shows an extreme value of negative fourteen point nine megapascals [-14.9 MPa]. I will now show “Upper bound bending in direction two” [2]. The left endpoint shows again an extreme value of negative forty six point two megapascals [-46.2 MPa]. \nNow, the “upper bound axial and bending” stress measure. [Axial and Bending reminder] To remind you, it is equal to the sum of the axial stress, normal bending stress in direction one [1], and in direction two [2]. Not surprisingly, the upper bound of the normal stress for this beam is sixty one point four megapascals [61.4 MPa] at its right endpoint. This value is a sum of zero point two megapascals [0.2 MPa] of an axial stress, fourteen point nine megapascals [14.9 MPa] of the bending stress in direction one [1], and forty six point two megapascals [46.2 MPa] of the bending stress in direction two [2]. Summing normal stresses this way provides a conservative estimate of the maximum total normal stress. That is why we call this measure “upper bound”.\n\nI will now check the “render beam profile” checkbox. Similar to shell elements, simulation allows me to plot stresses on a three D [3D] geometry of the beams with their rendered cross-sections. Notice that “upper bound” words were dropped from the name of this stress measure; it is now named “axial and bending”. I will click OK to regenerate the plot. You can now see the normal stresses extrapolated and plotted on the full rendered cross-sections of the beams. Observe one interesting fact. The extremes are still located at the left endpoint, but the maximum normal tensile stresses increased is now seventy seven point seven megapascals [77.7 MPa], and the maximum indicated compressive stress is eighty seven point six megapascals [87.6 MPa]. This may come as a surprise because the absolute maximum reported on the model without rendering the beam profiles was only sixty one point four megapascals [61.4 MPa]. The explanation of this difference goes beyond the scope of this lesson, but remember that stresses plotted on the rendered beams profiles are always more accurate, but not always larger in magnitude. It is therefore recommended to always check the normal stresses at both display settings, and use the larger one to stay on a conservative side of the design. In my case, I will therefore consider the value of eighty seven point six megapascals [87.6 MPa], as the maximum normal stress in this member, and so also in the model.', '0', '0');
INSERT INTO `cuepoints` VALUES ('35', '218', 'CH', 'Results - Shear stresses', '1004', '0', '1', '\nOK, now the transverse shear stresses. [PIP shear stress reminder] Transverse shear stress in direction one [1] and two [2]  peak at the cross-section neutral axis location, and they are zero at the cross-section ends.\n▲ The maximum transverse shear stress in direction one [1] at the left endpoint is about one point five megapascals [1.5 MPa]. Transverse shear in direction two [2] is then practically zero here. The transverse shear stresses therefore pose no problem.\nThe last stress to review is the torsional shear stress. [PIP torsional stress reminder] To remind you, the torsional shear stress is zero at the shear center, and it reaches the highest values in the extremities of the cross-section. In my case, torsion shear stress in this  beam is again very small and so it can neglected.', '0', '0');
INSERT INTO `cuepoints` VALUES ('36', '226', 'CH', 'Introduction, Agenda', '0', '47', '1', '\n\n[INT L6.1.5 Introduction] \nThe last part of this beam mesh lesson covers beam validation. The duration of this part is approximately thirteen minutes [13 minutes].\n\nThe following part will continue with a simulation of the acid dosing skid frame using the beam elements. By now you have already covered basics and some adv  anced topics of how to use beam elements. You are also familiar with the beam stress types reported by SolidWorks Simulation, and their postprocessing. I will now continue and show you how to use these results to validate the frame members. The material presented in this part of the lesson is more advanced. Introductory users may find this part of the lesson somewhat challenging, and are encouraged to consult their instructors.', '0', '0');
INSERT INTO `cuepoints` VALUES ('37', '226', 'CH', 'Beam - Validation', '47', '447', '1', '\nNow that you are familiar with all the stress measures available for beams, I can go ahead and show you how to validate this beam on strength. \n\n△  [PIP Beam results - failure criteria]\nFirst of all, it is important to understand that validating beams, and solids or shells is not exactly the same. For shells and solids, postprocessing offers equivalent stress combinations such as the “von-mises” stress, or stress intensity, combining all normal and shear stresses into one meaningful value that can be easily compared against the material yield strength. For beams such equivalent stress measure is not available. I have to validate them separately on the maximum normal stress, and the maximum shear stress. I will now demonstrate how this would be done at the left endpoint of the top left beam. This represents the most stressed location in the frame. The following table summarizes the maximum collected stresses. The maximum normal stress was eighty seven point six megapascals [87.6 MPa]. This value is directly reported by the software. Shear stresses are more challenging. I already mentioned that the calculation of the maximum total shear stress is not as easy for thin walled cross-sections. I will therefore apply a conservative approach, meaning that I will compute the maximum total shear tau max as a sum of the absolute values of the maximum transverse shear in direction one [1], plus the maximum transverse shear in direction two [2], and plus the maximum of the torsional shear stress. This gives a conservative estimate, or I can say the upper bound of the maximum total shear of approximately one point five megapascals [1.5 MPa]. As you can see, the maximum total shear stress found in this member is very small, and will not pose any problem here. Before proceeding further, I also have to check the torsional component of the total shear stress. Because the top left member is an open angle profile, significant levels of the torsional shear stress can cause warping, and then consequently significant secondary stresses caused by it. The green contour corresponds to a very small torsional shear stress, and so as I mentioned before, it can be neglected. I will therefore ignore the warping stresses as well, and proceed with the design validation.\n\nThe validation methodology I am using in this lesson is based on the maximum allowable stress design, as described in “Steel design guide series” by the “American Institute for Steel Construction”, chapter nine [9] titled “Torsional Analysis of Structural Steel Members”. A detailed validation procedure is out of the scope of this lesson. A procedure presented here is simplified, and applicable only to this training example. You must get familiar with the full methodology before applying it in your situation, or please consult a specialist. Different design validation methodologies may need to be followed in your country or geographical region. In the allowable stress design methodology, the maximum normal stress must be smaller than zero point six [0.6] times the strength design limit. For this beam, I got eighty seven point six megapascals [87.6 MPa] as the maximum normal stress, and it is not smaller than zero point six [0.6] times a hundred and thirty megapascals [130 MPa], which is equal to seventy eight megapascals [78 MPa]. Just to remind you, my design limit is equal to the material yield strength reduced by the required factor of safety of one point three [1.3].\n\nThe second criterion is for the shear stresses. In this criterion, the maximum shear stress must be smaller than zero point four [0.4] times the strength design limit. For this beam I got a very small total shear of approximately one point five megapascals [1.5 MPa], which is well below the shear strength criterion of zero point four [0.4] times a hundred and thirty megapascals [130 MPa], equal to fifty two megapascals [52 MPa]. As you can see, for longer slender beams which are not significantly loaded in torsion, shear typically does not pose difficulties.\nSo, the top left beam passes the maximum shear strength criterion, but it fails the normal stress criterion. It would most likely be enough to upgrade the angle profile one size up for this beam to also pass the maximum normal stress criterion.\n\nI will conclude with the following two important remarks. You saw that for longer slender beams without a significant torque loading, the shear stresses typically do not pose difficulties. The following would be a few examples where significant transverse shear stresses, however, do exist.\n-a very short beam. You already know that the classical beam element should be used for long and slender beams only. To correctly evaluate stresses in short beams, use shell or solid elements instead.\n-a long beam with a large isolated force applied near the joint. In this case, even though the beam is long and slender, having a significant force too close to the joint will make this part behave as a short beam, with potentially severe shear stresses. To correctly evaluate stresses in this short section of a long beam, use shell or solid elements instead.\n-a beam with its web significantly weakened by openings in order to make the beam higher and lighter. Again, in these situations, the beam elements are not a suitable choice because the cross-section varies greatly along the beam. You should use shell or solid elements instead.\n\nThe second remark is for beams that feature overly thin webs. Beware of situations, where beam cross-section is very high, because the web may become overly thin relative to the height of the cross-section. In such situations, local buckling of the compressed portion of the web may pose a serious threat, and the design strength limit may need to be significantly reduced. It is strongly recommended that users just beginning with simulation consult an experience person to gain more insight into the design and validation of high beams where local buckling may exist.', '0', '0');
INSERT INTO `cuepoints` VALUES ('38', '226', 'CH', 'Beam diagrams', '447', '582', '1', '\n\nOK. The last topic in this lesson is the beam diagrams.\n\nBeam diagrams are important for users interested in visualizing the beam’s internal forces. Because the simulation post-processing module offers the ability to show various stress measures, beam diagrams are less important today. However, some users may still be interested in their use, and I will show you how they are plotted. \nI will right click on the results folder and select “define beam diagrams”. I will select an internal force component, in this case “Moment in direction two” [2], and keep the units of newton-meters [N-m]. I will click “select”, select the beam with the faulty weld, and click OK. \n\n▲Notice that bending moment is zero where the faulty weld was defined. Clearly, the faulty weld could not transmit any bending moments into the joint, and that is why the beam rotated at its left endpoint. ▲ On the other side, where the beam endpoint was fully tied to the joint, bending moment reaches a significant value of  ▲  two hundred and eighty four newton-meters [284 N-m]. \n\n\n[List beam forces]\nAlternatively, beam internal forces plotted in the beam diagrams can be listed and exported. I will right click on the result folder and select “list beam forces”. ▲ I will keep forces, meaning that I want to list the internal forces, and click Ok to generate a list. The list is rather exhaustive, so you would typically click “show only beam end points”, or “show extreme values only”. Note that as I click each entry in the list, the beam is indicated in the graphics window. The values can also be saved for further reference. \n\nThis completes the advance portion of the beam lesson.', '0', '0');
INSERT INTO `cuepoints` VALUES ('39', '226', 'CH', 'Summary', '582', '0', '1', '\n  \n[INT L6.1.5 Summary] In the advanced parts of this beam lesson I\n\n\nIn this lesson I continued with a simulation of the acid dosing skid frame, and introduced you to the advanced topics of the beam simulation. I added corner gussets to the simulation study. Gussets had to be modeled with solid mesh, and so this study was your first exposure to mesh mixing solids and beams. We call this mesh type mixed mesh. Global bonding typically does not recognize bonds between various types of meshes with gaps. For this reason, I had to define local contacts between the end face of the gusset, and the beam. I discussed the importance of having sufficient mesh refinement close to the bonds in order for the bonded contact to form correctly. Then I talked about how beams connect to the joints. I showed you that beam may connect to the joint rigidly, as a hinge, or you can create a custom connection type by deactivating only the selected connection degrees of freedom. This way, I enabled the rotation of the left endpoint of this beam. The resulting displacements of this beam then of course grew, because the endpoint rotated.\nI then introduced you to the stress measures available for beams, which are different from those in solids and shells. I used this simple cantilever with various loading forces and moments at its endpoint. I showed you that in beams, we have stresses due to the axial force, causing uniform distribution of the normal stress. Then we have linear distribution of the normal bending stress, varying from the tensioned side to the compressed side. Normal stresses can be summed, because they have the same direction. Then we have two transverse shear stresses peaking at a cross-section neutral axis, and torsional shear stress. I collected these stress values for the top left beam, and calculated their sum. For normal stress sum is easy and is reported by the software directly. I got eighty seven point six megapascals [86.7 MPa]. For shears, calculation of the sum is more complicated, and so I used a conservative approach. I summed absolute values of the maximums for all shear stresses. The resulting total shear was very small, however, only about one and a half megapascals [1.5 MPa]. Because the top left member is open thin wall cross-section, I also discussed warping. But torsional shear stress is practically zero, so the warping secondary stresses can be ignored.\nI also discussed a few situations, where significant transverse shear stresses may exist: a short beam, a long beam with a significant force near the joint, and a beam with a weakened web. I also warned you that in case of a high beam with thin web, local buckling may significantly reduce its strength.\nTowards the end of the lesson I used a simplified allowable stress design methodology to validate the design of the top left beam. I found out that while the top left beam passes the maximum shear strength criterion, it fails the maximum normal stress criterion. The angle profile would have to be upgraded to the next size up. Remember, that validation presented in this exercise is applicable to this training exercise only. You must fully understand the validation methodology by studying the provided references, or consulting a specialist. Also, based on your geographical presence, you will have to follow your local guidelines governing the design validation.', '0', '0');
INSERT INTO `cuepoints` VALUES ('40', '247', 'CH', 'Guided exercise', '0', '141', '1', '\n\n[INT Intro slide] In this exercise, you will simulate a model of the a light trailer. The duration of this exercise is fifty five [55 min] minutes.\n\n\n[Guided exercise]\nThis is a guided exercise where you will follow onscreen steps. If you have not already done so, please download the training files first. You can do it in two ways. Click the instructions icon next to the exercise folder to open the instructions popup, then click the training files icon, and download the exercise files into your work folder. This method downloads only the files for this specific exercise. Alternatively, you can click the training files icon located in the right bottom corner of the player, and download the files. This method downloads the files for the entire course, and so it may take a little more time. \nStart with playback of the first chapter; typically this will be the exercise introduction. When the video reaches the software section, the playback will automatically pause at the end of each step. Then replicate the same step in SolidWorks. Continue viewing and replicating the following steps until you complete the entire exercise. \nYour work will be most efficient if you use two monitors, or two computers; the first one to view the video, and the second one for your work with the software.', '1', '0');
INSERT INTO `cuepoints` VALUES ('41', '247', 'CH', 'Introduction', '141', '185', '1', '\n\n[INT Introduction]\nIn this exercise you will simulate model of a light trailer. Trailer such as this one can be used for small excavators, boats and similar purposes. The purpose of this exercise is to have you practice usage of the beam element. You will practice creation of the beam mesh, generation of the joints, and postprocessing of the results obtained from the beam elements. Some information on improper usage of the beam mesh in some situations will be explained as well. Improper usage of the beam mesh leads to meshes which do not reflect the real object correctly, and causes incorrect results.', '0', '0');
INSERT INTO `cuepoints` VALUES ('42', '247', 'CH', 'Model definition', '185', '194', '1', '\nOpen the Trailer assembly from your work folder. \n[SM]\nThis assembly consists of a typical A-frame design with a tow hitch, jockey wheel; and an axle wheel assembly with leaf springs.\n[SM]\nFor the purposes of this exercise you will use only the frame model and use the assembly purely as reference. \nGo ahead and open the trailer frame weldment part.\n\n\n\n[SM]\nThere are various possibilities how this model can be set up and solved. For example you could use shell elements, but the setup would be quite tedious. Solid elements could be used as well, but they are not the best choice because the members are long, slender and thin. It is quite clear then, that this type of structure calls for use of the beam elements. As you will see, however, there are still a few parts in this frame where beams are not ideal, and where shells or even solids are better a choice.\n\n[SM]\n[E6.2 PIP profiles] The frame is built from a hundred PFC [100PFC] C-channels; a hundred times fifty rectangular hollow sections [100x50RHS]; and fifty times fifty square hollow sections [50x50SHS].\n\nConnections between the members contain one millimeter [1 mm] welding gaps for the manufacturing purposes.', '0', '0');
INSERT INTO `cuepoints` VALUES ('43', '247', 'H', '', '194', '207', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('44', '247', 'H', '', '207', '220', '1', '', '0', '1');
