INSERT INTO `cuepoints` VALUES ('46', '247', 'H', '', '253', '282', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('47', '247', 'CH', 'Material, Loads, Design criteria', '282', '434', '1', '\n\n[PIP Materials, Load, Design criteria] The frame is manufactured from grade two-fifty [GR250] mild steel, with the yield strength of two hundred and fifty megapascals [250 MPa] and the tensile strength of four hundred and ten megapascals [410 MPa].\nIf the results prove that the material is not adequate, you have an option to upgrade it to the grade three-fifty [GR350] with the yield strength of three hundred and fifty megapascals [350 MPa], and the tensile strength of four hundred and fifty megapascals [450 MPa].  Both materials are included in the material database supplied with the exercise files.\n\nBecause trailers such as the one simulated in this exercise are exposed to a wide range of complex loads, numerous testing procedures have been developed. In this exercise, you will be simulating one of such testing procedures. The trailer is attached to the support frame, and is loaded with a vertical force on the tow hitch. The magnitude of the force is calculated from the following equation: force is equal to zero point five, times the aggregate trailer mass in kilograms, times the gravity acceleration of nine point eighty one meters per second square [F=0.5*ATM*9.81].\nIn the case of this trailer, the aggregate trailer mass is two thousand kilograms [2000 kg], and so the loading force is then equal to nine thousand eight hundred and ten newtons [9810 N].\nThis equation was borrowed from the Australian vehicle standard, the design rule sixty two dash zero two [62-02]. It specifies requirements for mechanical connections between vehicles and their fitment, in order to ensure positive mechanical engagement for vehicle combinations, and to prohibit disengaging of devices. This standard prescribes testing procedures for the longitudinal tension and compression, transverse thrust, and the vertical tension and compression. As you know by now, in this exercise, we chose the testing procedure with the vertical force oriented upward.\n\nThe design criteria are as follows. The maximum stresses cannot reach beyond the material’s yield strength. This corresponds to a factor of safety equal to one [FOS=1]. Such criterion can be used for ultimate strength tests such as the one simulated in this exercise.\nThe maximum displacement cannot be more than two percent [2%] of the frame length. Given the overall length of the frame three point seven meters [3.7m], this corresponds to a maximum deflection of approximately seventy four millimetres [74 mm].', '0', '0');
INSERT INTO `cuepoints` VALUES ('48', '247', 'CH', 'Beams study', '434', '440', '1', '\n\nOk. Go ahead and create a new static study.', '0', '0');
INSERT INTO `cuepoints` VALUES ('49', '247', 'CH', 'Assign Materials', '440', '473', '1', '\n\nNext, assign materials to all components. First, go to tools; options; and under “file locations”; Material Databases; add a path to your work folder with the exercise files. [PIP sldmat file] Materials used in this exercise are stored in a custom database supplied with the exercise training files. \n[SM]\nAssign material to all bodies in the simulation tree. Scroll down in the materials window to where the custom libraries are listed, expand the library for grade two fifty [GR250] and grade three fifty [GR350] steels, and select and assign grade two fifty [GR250].', '0', '0');
INSERT INTO `cuepoints` VALUES ('50', '247', 'H', '', '473', '492', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('51', '247', 'CH', 'Element selection, Simplification', '492', '525', '1', '\n\nReview the parts folder next. Naturally, since the weldment toolkit was used to create this frame, simulation treats all bodies as beams. The only body treated as solid is this end cap. It does not have a significant structural function; it primarily seals the end of the front member. Exclude it from analysis.', '0', '0');
INSERT INTO `cuepoints` VALUES ('52', '247', 'CH', 'Joints - Default', '525', '562', '1', '\n\nNotice also, that because simulation is treating many members as beams, the default joints were calculated automatically. \n\nHowever, you can see that they are not entirely correct because many of them are yellow where they should not be. This means that only a single member is connected to them, which implies that many members are disconnected. [PIP welding gaps] This is caused by the weld gaps mentioned earlier. And because the default joints are created for touching members only, most members are now indeed disconnected. You will have to correct the joints manually.', '0', '0');
INSERT INTO `cuepoints` VALUES ('53', '247', 'CH', 'Joints - Manual edit', '562', '568', '1', '\n\nTo see joints’ detailed definitions, right-click on the joint group folder and edit it. \n[SM]\nRight-click, for example, on this yellow joint to see that it is indeed connected to only one beam. This, of course is not correct because there is a weld connecting this beam to the cross-member. \n\nYou will need to correct these joints before proceeding any further, because this arrangement would not provide desired results. \n[SM]\nTo fix this particular joint manually, click on this cross-beam to add it to this joint, and then close the joint window. \n[SM]\nClick “recalculate”, and notice that the sphere color changed to magenta, indicating that there are now two or more beams connected to this joint. This process of editing each joint individually is powerful, but it would obviously take some time. Instead, you can edit settings for the entire joint group, and recalculate all joints to obtain a more suitable solution.', '0', '0');
INSERT INTO `cuepoints` VALUES ('54', '247', 'H', '', '568', '589', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('55', '247', 'H', '', '589', '597', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('56', '247', 'H', '', '597', '622', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('57', '247', 'CH', 'Joints - Clearance', '622', '633', '1', '\n\n ▲ Notice that by default only joints for touching members were calculated. But because this model contains weld gaps, many beams were not connected to their respective joints. \n[SM]\nChange the joints clearance setting from touching, to a “less than” option, which will allow you to enter a maximum gap clearance value. The warning message shown at this time warns you that the existing joint solution will be lost. You want to re-calculate the joints anyways, so click “yes” to proceed. \n[SM]\nNow, given the sizes of the members and their connections, fifty millimeters [50mm] seems a good value to try. Make sure that units are set to millimeters; and enter fifty millimeters [50mm].\n\n[SM]\n\n[PIP joint clearance] Now, I will demonstrate the joint clearance on the following example of three members with gaps between the endpoints. As you saw a moment ago, the default joint calculation only considers touching members, and so the default joint layout would be as follows: yellow joints at an endpoint of each beam. The underlying mesh would feature three disconnected beams. \nNow, let’s consider a situation where the distance between the endpoints of the two beams, and the neutral axis of the perpendicular beam is less than fifty millimeters [50mm], but the distance between the two endpoints is more than fifty millimeters [50mm]. If I specify the joint clearance of fifty millimeters [50mm] and re-calculate the joints, two magenta joints will be created. Each one is connected to its respective beam’s endpoint, and to the neutral axis of the perpendicular beam passing through. For example this joint is connected to the endpoint of this beam, and to the neutral axis of the perpendicular beam. The underlying mesh would look as follows. Each joint contains a rigid bar in black color, connecting the neutral axis of the perpendicular beam to the nearest joint. \nNow, the last scenario to consider is when the two endpoints are less than fifty millimeters [50mm] apart. With the joint clearance set again to fifty millimeters [50mm], the simulation software would re-generate only one magenta joint, now connected to all all three beams. The underlying mesh will feature a fairly long rigid bar connecting this endpoint as well as the neutral axis of the perpendicular beam passing through to this joint. Of course, this beam is connected to the same joint as well. \n[SM]\n▲ Make sure the “keep modified joints on update” option is checked. “Keep modified joints on update” means that ▲ this joint which you modified manually in the previous step will not be recalculated. Because you fixed this one joint manually, it does not need to be recalculated, even though nothing would change if you also recalculated this joint. \n[SM]\nClick calculate to obtain a new joint solution.\n\n\n\n\n[SM]\nYou can right click on any joint, for example this one, and review the beams connected to it. It all looks correct now.\n[SM]\nClick OK to close the property manager. As you close the property manager, a warning message will pop up. It informs you that the joints were recalculated and their numbering scheme has changed, even though they may visually look the same. Click OK to acknowledge this, and let’s proceed with meshing.', '0', '0');
