INSERT INTO `cuepoints` VALUES ('65', '247', 'CH', 'Mesh - Beams only', '826', '837', '1', '\n\nRight-click the Mesh folder and select “Create mesh”. Because there are neither shells nor solids in this simulation model, the meshing process starts immediately. \n[SM]\nNow, take a few minutes to review the mesh. Especially the two horizontal strengthening members on the bottom need some attention.\n\n[PIP strengthening members 1] These two square strengthening sections are welded to the bottom flange of the main side C-channels, and their function is to strengthen the C-channels close to the axle. Also the leaf springs are connected to them.\n\nBy default, they are meshed with the beam elements, ▲ with two end joints not connected to the frame; that is why their end joints are painted in yellow. Effectively, these two strengthening members are disconnected from the frame. \nNow, remember that two parallel beams cannot be continuously bonded, ▲ except at these five joints which would have to be manually edited. Let’s give it a try and see what mesh comes out of such an approach. \n[SM]\nEdit the joint group. \n[SM]\nRight-click on the first joint to edit it, and add the strengthening member to it. As you do this, pay attention to the underlying geometry; something may feel strange. The strengthening member seems quite far from the joint that it is being added to; it is also not very clear here what geometry makes up the joint. \n[SM]\nClose the joint edit window. \n[SM]\nRepeat the same steps for the next three joints. \n[SM]\nTo connect the endpoint of the strengthening member, ▲ do not edit the joint on the main C-channel; it is quite far from this end of the strengthening member. Instead, edit the yellow joint on the strengthening member, and add a C-channel member to it. \n[SM]\nDo not edit joints on the second strengthening member on the opposite side of the frame, because, as you will see shortly, the resulting mesh will not provide a suitable representation of the real geometry in this region. \n[SM]\nClick “calculate” to generate new set of joints, The two yellow joints on the strengthening member disappeared, because it is now connected to the joints on the C-channel. \n[SM]\nClose the joint group property manager. You can dismiss the warning that the joints were recalculated. \n[SM]\nCreate new mesh; and let’s review it.  \n\n[SM]\nThis mesh features very large joints formed with the help of rigid bars. For example this joint is located right here at the intersection of neutral axes of the main c-channel and the fifty-by-fifty square profile. The rigid bar then extends this joint down to the end of the strengthening member. The joint size, here the size of the rigid bar, is large relative to the dimensions of the connected beams. Also, between any two joints connecting the strengthening member to the main c-channel, ▲ for example these two, the beams are not connected. This model is not accurate, deviating from the real structure at this location quite a bit. Also, recall that by design, beam elements should be used for smooth, long and slender members, such as the C-channel member alone.\n\n[PIP strengthening members 2] This region is more complex. We have a second strengthening member continuously welded to the bottom flange of the C-channel, and effectively resulting in a more complex structure with variable cross-section profile. \n\n\n\nForcing beam elements for all members is not the best choice in this and similar situations. The most suitable solution is to model the two strengthening members as solids or shells. The simulation model must be therefore corrected. \n[SM]\nBefore correcting it, turn on the three D [3D] mesh view to render the real beam profiles. \n[SM]\nBeware of the three d [3D] mesh display in these situations.\nWhile this plot provides nicer view, it can be misleading because it does not show the rigid bars. It looks as if everything was ok, that the mesh represented the real structure perfectly,  but it is not immediately apparent what the shapes of the joints are. \n[SM]\nTurn off the three d [3D] mesh view and let’s correct the model by modeling the two strengthening members as solids. \n\nPART 2', '0', '0');
