INSERT INTO `cuepoints` VALUES ('80', '247', 'CH', 'Beams and Solids study', '1102', '1111', '1', '\n\nExpand the parts folder; and treat these two strengthening members as solids.', '0', '0');
INSERT INTO `cuepoints` VALUES ('81', '247', 'CH', 'Joints', '1111', '1131', '1', '\n\nNext, because the element type for the strengthening members was changed, you need to update the joints. Edit the joint group folder, and uncheck the “Keep modified joint on update” option. This option is not needed because we want to recalculate all joints, and so dismiss the warning window. \n[SM]\nCalculate new joints.\n[SM]\nAll joints are recalculated. Only the true endpoints have yellow joints. For example, ▲ this joint at the end of the A-frame is marked as yellow because it is not connected to any other member. ▲ The same is for the endpoints of the last member at the back of the trailer.\n[SM]\nClick OK to close the edit joints property manager. You can dismiss the warning window.', '0', '0');
INSERT INTO `cuepoints` VALUES ('82', '247', 'H', '', '1131', '1133', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('83', '247', 'H', '', '1133', '1151', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('84', '247', 'H', '', '1151', '1159', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('85', '247', 'CH', 'Mesh - Beams and Solids #1', '1159', '1176', '1', '\n\nRemesh the model with the fine settings. Move the mesh slider all the way to the right, and use the standard mesher. \n[SM]\nThe mesh now looks good, with the exception of the beam mesh in the two longitudinal C-channels. Because they have solid bodies of the strengthening members bonded to them, their mesh should be refined in order to improve the bond.\n[SM]\nApply mesh control to both C-channel beams; and specify a hundred [100] elements for each. \n[SM]\nWhen done, remesh the model with the fine settings one more time. \n[SM]\nThis looks much better, because you have more beam nodes that will be bonded to the top flange of the strengthening member.', '0', '0');
INSERT INTO `cuepoints` VALUES ('86', '247', 'H', '', '1176', '1198', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('87', '247', 'H', '', '1198', '1213', '1', '', '0', '1');
