INSERT INTO `cuepoints` VALUES ('90', '247', 'CH', 'Contacts', '1239', '1267', '1', '\n\nThe next are contacts between the two strengthening members and the two longitudinal channels. Right click either on “connections” or any of its subfolders, select contact set; select “bonded” as type; specify beam as the input type for the first field; and select the main longitudinal channel on one side. \n[SM]\nThen select the top face of the corresponding solid member underneath it in the second selection field. \n[SM]\nPin the contact set property manager, and repeat the same step for the other side.', '0', '0');
INSERT INTO `cuepoints` VALUES ('91', '247', 'H', '', '1267', '1274', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('92', '247', 'H', '', '1274', '1301', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('93', '247', 'CH', 'Fixtures', '1301', '1352', '1', '\n\nThe next are fixtures. \n[PIP fixed geometry vs. fixed hinge] The fixtures in this model need to simulate this bolted connection between the strengthening members, and the vertical link. The link is eventually bolted to the support frame, but that is not part of our model. You have to introduce some assumptions here. You can can assume that the bolted connection is strong, and does not allow for any slippage, in which case the fixed geometry would be an appropriate choice. This would be a safe fixture choice if you were simulating the connection region, because this stiff fixture would concentrate more stress here. For the design of the frame, it is safer to assume that the bolted connection does eventually allow some slippage, in which case the fixed hinge fixture would be an appropriate choice.\n[SM]\nSo go ahead and define the fixed hinge fixtures on all eight cylindrical surfaces of the four holes.', '0', '0');
INSERT INTO `cuepoints` VALUES ('94', '247', 'H', '', '1352', '1399', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('95', '247', 'CH', 'Load', '1399', '1418', '1', '\n\n△ Next, define a force. Click the joint icon to specify the input field type; select the joint at the end of the A-frame, activate the second field for the direction, and select the top face of this member for the direction. \n[SM]\nThen activate the last, normal to reference plane, direction for force, and enter nine thousand eight hundred and ten newtons [9810 N]. Make sure that your joint force is oriented vertically upward. \n[SM]\n[PIP force location] During the test, the force is applied to the tow hitch. Because we did not include the tow hitch in this simulation, the next best location where to apply the force is the end joint of the A-frame. The discrepancy caused by this is negligible.', '0', '0');
INSERT INTO `cuepoints` VALUES ('96', '247', 'H', '', '1418', '1438', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('97', '247', 'H', '', '1438', '1459', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('98', '247', 'CH ', 'Mesh - Beams and Solids #2', '1459', '1472', '1', '\n\nRemesh the assembly with slider moved again to the fine settings.', '0', '0');
INSERT INTO `cuepoints` VALUES ('99', '247', 'CH', 'Solution', '1472', '1482', '1', '\n\nRun the simulation. It is very quick, despite the solid bodies.', '0', '0');
INSERT INTO `cuepoints` VALUES ('100', '247', 'CH', 'Results - Stresses, Solids', '1482', '1487', '1', '\n\nBefore postprocessing the results, turn off the simulation symbols. \n[SM]\nStresses in solid bodies are displayed by default. Notice the stress spots on the top flange of the strengthening member. \nYou actually want to see such spots in this plot. They are caused by the bonds with the nodes of the C-channel beam above. This is a visual reference that the bonding worked correctly. The absolute values of the stresses in this plot are very high, and they have to be analyzed with caution, however. \n[SM]\nSet the legend limit to the yield strength of two hundred and fifty megapascals [250 MPa]. \n[SM]\nStress magnitudes on the top flange have to be ignored, because they are polluted by the isolated patches due to bonding with the beam. Better modeling would be required to assess this component accurately. However, you can now see clearly that the front side of the strengthening member, in the vicinity of the fixture, is severely stressed all the way throughout. Even with the isolated patches on the top flange locally polluting the stress results, it is clear that this area of the strengthening member is stressed beyond its limits. The cross-sectional dimensions of the components will have to increase. Also, it is clear that this area is critical for the weld, connecting the strengthening member to the C-channel above it.', '0', '0');
INSERT INTO `cuepoints` VALUES ('101', '247', 'H', '', '1487', '1521', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('102', '247', 'H', '', '1521', '1533', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('103', '247', 'H', '', '1533', '1580', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('104', '247', 'CH', 'Results - Displacements', '1580', '1583', '1', '\n\nLet’s now focus on the displacements. \n[SM]\nThe maximum reached about sixty six millimetres [66 mm]. This is less than the limit of seventy four millimetres [74 mm], and so on displacements, this frame is passing.', '0', '0');
INSERT INTO `cuepoints` VALUES ('105', '247', 'H', '', '1583', '1594', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('106', '247', 'CH', 'Results - Normal Stresses, Beams', '1594', '1605', '1', '\n\nGo ahead and create a new stress plot, click “Beams”, and keep the “Upper bound axial and bending” measure.\n[SM]\n [Axial and Bending reminder] To remind you, this stress is equal to the sum of the axial stress, bending stress in direction one [1], and in direction two [2]. The maximum reached about three hundred and forty megapascals [340 MPa]. The values in this plot represents the absolute maximums, and so it is not known from this plot whether the three hundred and forty megapascal [340 MPa] stress is tension or compression. \n[SM]\nEdit the chart options, change the chart maximum to two hundred and fifty megapascals [250 MPa] which is the yield strength of grade two fifty [GR250], and activate the max annotation.\n[SM]\nThe highest normal stress of three hundred and forty megapascals [340 MPa] is located in the main C-channel, close to the fixture location. ▲ In fact, this entire portion of the C-channel is stressed significantly, well above the material yield.\n\n\n\n[SM]\nThe maximum normal stress in the beams must also be verified on a plot with the real beam profiles rendered in three d [3D]. So, edit the existing stress plot; and check the “render beam profile” option. The “axial and bending” should already be selected. If not, select this normal stress measure, and click OK to update the plot. \n[SM]\nWith the real profiles rendered, stresses can be extrapolated over the entire cross-sections, and so both negative values indicating the compressive side of the cross-section, and positive values indicating the tensile side of the cross-section can be shown. \n[SM]\nEdit the legend limits, and specify negative two hundred and fifty megapascals [-250 MPa] as the limit for the compressive stresses. \n[SM]\nAlso activate the minimum stress annotation. \n[SM]\n▲ The maximum compressive stress is located on the top flange of the C-channel, at the same location close to the fixture. It reaches a magnitude of negative three hundred and thirty four megapascals  [-334 MPa]. \nThe bottom flange recorded some two hundred and ninety nine megapascals [299 MPa] of tensile stress. These numbers are smaller than the maximum of three hundred and forty megapascals [340 MPa] obtained from the “Upper bound axial and bending” stress measure plot we examined previously.', '0', '0');
INSERT INTO `cuepoints` VALUES ('107', '247', 'H', '', '1605', '1631', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('108', '247', 'H', '', '1631', '1650', '1', '', '0', '1');
