INSERT INTO `cuepoints` VALUES ('110', '247', 'H', '', '1668', '1709', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('111', '247', 'H', '', '1709', '1720', '1', '', '0', '1');
