INSERT INTO `cuepoints` VALUES ('113', '247', 'H', '', '1731', '1765', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('114', '247', 'CH', 'Results - Transverse shear, Beams', '1765', '1785', '1', '\n\nYou will also have to review the transverse and torsional shear stresses. First, look at the transverse shear. [PIP shear stress reminder] Transverse shear stresses in direction one [1] and two [2]  peak at the cross-section neutral axis location, and they are zero at the cross-section ends. \n[SM]\nGo ahead and define a new stress plot. Click “beams”; select shear in direction one [1], pin the property manager and click OK. \n[SM]\n▲The maximum value is quite substantial, about fifty one megapascals [51 MPa] located just to the right of the critical joint. ▲ The shear stress value just to the left of the critical joint is approximately twenty megapascals [20 MPa]. \n[SM]\nChange the stress measure to shear in direction two [2]. \n[SM]\n▲ The maximum value of about forty three megapascals [43 MPa] shifted to another beam, so just by looking at the contours we can see that the numbers are somewhat smaller; about ▲ seventeen megapascals [17 MPa] located to the right of the critical joint, and only about nine megapascals [9 MPa] just to the left of the joint.', '0', '0');
INSERT INTO `cuepoints` VALUES ('115', '247', 'H', '', '1785', '1801', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('116', '247', 'H', '', '1801', '1816', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('117', '247', 'H', '', '1816', '1821', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('118', '247', 'H', '', '1821', '1840', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('119', '247', 'CH', 'Results - Torsional shear, Beams', '1840', '1849', '1', '\n\nNext, you need to review the torsional stress. Change the stress measure to torsional stress component and update the plot.\n[SM]\n ▲The straight c-channel carries about seventeen megapascals [17 MPa] of the torsional shear stress just to the right of the critical joint, ▲ and about forty nine megapascals [49 MPa] just to the left of the critical joint. Again, this is a significant value.\n[SM]\nYou can unpin the stress property manager, and close it. \n[SM]\n▲ The maximum torsional stress is located in these two diagonal c-channels, reaching almost ninety four megapascals [94 MPa]. These two c-channel diagonals are critical design elements from the perspective of torsional stress.', '0', '0');
INSERT INTO `cuepoints` VALUES ('120', '247', 'H', '', '1849', '1863', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('121', '247', 'H', '', '1863', '1870', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('122', '247', 'H', '', '1870', '1885', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('123', '247', 'CH', 'Validation', '1885', '2150', '1', '\n\nNow that you have collected all stress magnitudes at the location of the critical joint, you have to validate the beam on strength.\n\n[PIP C-channel validation] Here is a table summarizing the collected magnitudes. The maximum normal stress just to the right of the joint, and just to the left of the joint is about the same, three hundred and forty megapascals [340 MPa]. \nTo obtain the total maximum shear stress, you have to sum all shear components. Their summation is quite complicated, however, especially for thin walled cross-sections. And so we will apply a conservative approach, meaning that we will compute the maximum shear as a sum of the absolute values of the maximum transverse shear in direction one [1], plus the maximum transverse shear in direction two [2], and plus the maximum of the torsional shear stress. This gives a conservative estimate, or I can say the upper bound of the maximum total shear of approximately seventy eight megapascals [78 MPa] just to the left of the critical joint, and eighty five megapascals [85 MPa] just to the right of the critical joint. The cross-section just to the right is stressed more, but it is clear that the c-channel is stressed well beyond its limits. But let’s proceed step by step with a validation of the cross-section just to the right of the critical joint.\n\nThe cross-section just to the right is stressed more. At this point, we still have to review the torsional stress plot again and decide on secondary stresses caused by warping. Careful examination reveals that all warning signs for warping are present: the cross-section just to the left is showing significant torsional stress of forty nine megapascals [49 MPa]; the beam is relatively short in relation to its height, and the c-channel is an open cross-section, which means that it will tend to warp if allowed to. Because the endpoints are welded to fairly large joints, free warping will be restricted and therefore significant secondary stresses could develop. To stay on a safe side of the design, we would therefore verify these beam element results with a new study, with this region meshed using solid or shell elements. Because this is an extra work, we would only do it once we conclude that the existing design is safe. We will therefore proceed with the validation.\n\nWe will follow the allowable stress design methodology as described in “Steel design guide series” by the “American Institute for Steel Construction”, chapter nine [9] titled “Torsional Analysis of Structural Steel Members”. A detailed validation procedure is out of the scope of this exercise. A procedure presented here is simplified, and applicable only to this training exercise. You must get familiar with the full methodology before applying it in your situation, or please consult a specialist. Different design validation methodologies may need to be followed in your country or geographical region.\n\nIn the allowable stress design methodology, the maximum normal stress must be smaller than zero point six [0.6] times the strength design limit. For this beam, we got three hundred and forty megapascals  [340 MPa] as the maximum normal stress, which is a way more than zero point six [0.6] times the design limit of two hundred and fifty megapascals [250 MPa], which equals to a hundred and fifty megapascals [150 MPa]. Just to remind you, the design limit for grade two fifty [GR250] in this exercise is equal to the material yield strength of two hundred and fifty megapascals [250 MPa]. The factor of safety was kept at a value of one [1], because the test case loading represents the ultimate scenario.\n\nThe second criterion is for shear stresses. In this criterion, the maximum shear stress must be smaller than zero point four [0.4] times the strength design limit. For this beam, we got eighty five megapascals  [85 MPa] as the maximum total shear stress, which is less than the shear strength criterion of zero point four [0.4] times two hundred and fifty megapascals [250 MPa], which is equal to exactly one hundred megapascals [100 MPa]. \nSo, the critical location of the c-channel passes the maximum shear strength criterion, but it fails the normal stress criterion by a significant margin. Clearly, the material as well as the cross-sectional dimensions must change.\n\nOn your own, try to validate the c-channel at the location of the first diagonal segment where the maximum torsional stresses were calculated. Is the beam failing at this location as well? Submit your answer to your instructor.', '0', '0');
INSERT INTO `cuepoints` VALUES ('124', '247', 'CH', 'Beam diagrams', '2150', '2157', '1', '\n\nNext, show a beam diagram of internal forces for one of the most loaded C-channels.\n[SM]\nRight click the results folder and select “Define beam diagram”. \n[SM]\nSelect moment in direction two [2]. This one is expected to be much larger than the moments along the direction one [1]. \n\n[PIP local beam directions] To view the beam directions one [1] and two [2], you need to edit the specific beam member in the parts folder, and activate the local beam directions. Direction one [1] is identified with the green arrow, direction two [2] with the blue arrow, and the red arrow identifies the axial direction for the beam.\n[SM]\nClick the “select” option, and select this C-channel beam. \n[SM]\nClick OK to show the diagram.\n[SM]\nThe maximum bending moment of approximately eight thousand and eight hundred newton-meters [8 800 N-m], is naturally located close to the fixture where the strengthening member terminates and where the fixture is located. This is a considerable moment, and as you saw, it caused the normal stresses well above the capacity of this cross-section and its material.\n\n[SM]\nThis concludes your first exercise focused on the usage of beam elements. The last part of this exercise is a summary.', '0', '0');
INSERT INTO `cuepoints` VALUES ('125', '247', 'H', '', '2157', '2162', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('126', '247', 'H', '', '2162', '2191', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('127', '247', 'H', '', '2191', '2197', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('128', '247', 'H', '', '2197', '2199', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('129', '247', 'H', '', '2199', '2219', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('130', '247', 'H', '', '2219', '2227', '1', '', '0', '1');
INSERT INTO `cuepoints` VALUES ('131', '247', 'CH', 'Summary', '2227', '0', '1', '\n\n[PIP Summary] In this exercise you simulated one of the testing procedures to verify safety of a light trailer. In this procedure, the trailer is bolted to the supporting frame, and is loaded with a vertical force acting on the tow hitch. The force magnitude and the test configuration was taken from the Australian vehicle standard.\nBecause all members were created using the weldment toolkit, SolidWorks simulation by default treated all members as beams. The specifics of this model were the welding gaps between the members. As a result, the members were not touching and this affected the generation of joints. The default set of joints generated automatically featured numerous yellow joints connected to only a single member. And so most of the members in the model were initially disconnected. You therefore edited one of the joints manually, and added to its definition the second cross-member. Similarly, you can also remove a member from the joint. Remember, that to edit joints manually, the “keep modified joint on update” checkbox needs to be checked. The recalculated joint solution then featured one corrected magenta joint, connecting the selected two beams. Because it would take some time to manually edit all joints, you learned how to use the joint clearance option. You set the joint clearance to fifty millimeters [50mm], meaning that any two endpoints or neutral axes less than fifty millimeters [50mm] apart will be considered as connected to a single joint. The recalculated joint solution was then correct. All joints connecting at least two members were shown in magenta color, while the joints at the true endpoints, connected to only a single member, were in yellow color. The mesh then contained all beams connected at the joints. The exception were the two strengthening members with yellow joints at its ends, thus disconnected from the rest of the structure. You therefore edited the joins on the C-channel and added the strengthening members to them. The resulting mesh was not good, however. The joints with the rigid bars were too large relative to the sizes of the connected beam members, to correctly represent the real situation. Beware of the three d [3D] mesh display with rendered profiles. It provides a nicer view of the mesh, but the rigid bars are hidden. Everything may therefore appear ideal, even though it is not so in this model. The only reasonably accurate approach was to treat the two strengthening members as solids, and bond them to the C-channels. When applying fixtures we decided to allow for some rotational slippage in the bolted connection to the frame. And so you defined fixed hinges on the respective bolt holes faces. The resulting stresses in the strengthening members on the top flange showed isolated, fictitious hotspots, caused by isolated bonds to the nodes of the C-channel beam mesh. With the legend set to the grade two fifty [GR250] yield strength, it became apparent, however, that this member is yielding throughout and its cross-section dimensions or material will need to change. When postprocessing beams, you have to look separately at its normal and shear stresses, because beams do not offer an equivalent stress measures such as von mises stress. The maximum normal stress, a combination of axial and bending stress, reached about three hundred and forty megapascals [340 MPa]. This plot, where the beam cross-sections are not rendered, shows only the upper bound of the maximum, and so it was not clear whether it is three hundred and forty megapascals [340 MPa] of tension or compression. But from the perspective of the design on the maximum stress, this information is less important. It is also recommended to always check the maximum normal stress on a plot with the beam cross-sections rendered in [3D]. This view clearly shows the tensile and compressive stresses distributed across the beams’ rendered cross-sections. Stresses in this plot were somewhat smaller, about negative three hundred and thirty four megapascals  [-334 MPa] of compression in the top flange, and some two hundred and ninety nine megapascals [299 MPa] of tensile stress in the bottom flange, located just to the left of the critical joint. For the validation purposes, you of course used the highest absolute value, in this case three hundred and forty megapascals [340 MPa] found in the previous plot with the rendered cross-sections turned off. \nNext, you reviewed transverse and torsional shear stresses. For transverse shear in direction one [1], we got fifty one megapascals [51 MPa] located just to the right of the critical joint, and about twenty megapascals [20 MPa] located to the left of the critical joint. In direction two [2], we got about seventeen megapascals [17 MPa] located just to the right of the critical joint, and only about nine megapascals [9 MPa] located just to the left of the critical joint.\nFor torsional shear stress, this beam reached forty nine megapascals [49 MPa] just to the left side of the critical joint, and only about seventeen megapascals [17 MPa] located on the right of the critical joint. \nI also mentioned that because of the significant torsional stress, relatively short beam, open thin wall cross-section and fairly large welded joints, the secondary stresses due to the restricted cross-section warping are likely. To stay on a safe side of the design, we could verify the beam results with the solid elements study. That would only be done, however, once the design is validated.\n\nThis table summarizes all results in the beam near the critical joint. The maximum normal stress just to the right of the joint, and just to the left of the joint is about the same, three hundred and forty megapascals [340 MPa]. Because the shear stress summation is fairly complicated for thin walled cross-sections, we conservatively summed absolute values of maximums for all three shear stress measures: transverse shear in direction one [1], transverse shear in direction two [2], and the torsional shear stress. The cross-section just to the right of the critical joint was found to have about eighty five megapascals [85 MPa] of the total shear stress, and so we used it for the design validation.\n\nUtilizing the allowable stress design, it was found that the c-channel beam satisfies the maximum shear stress criterion, but it fails the maximum normal stress criterion by a wide margin. Clearly, its cross-sectional dimensions would have to change, and its material would have to be upgraded to at least grade three fifty [GR350]. \n\nRemember, that validation presented in this exercise is applicable to this training exercise only. You must fully understand the validation methodology by studying the provided references, or consulting a specialist. Also, based on your geographical presence, you will have to follow your local guidelines governing the design validation.', '0', '0');
