INSERT INTO `cuepoints` VALUES ('601', '4812', 'CH', 'Summary', '3690', '0', '1', '', '0', '0');
INSERT INTO `cuepoints` VALUES ('602', '9287', 'CH', 'Introduction, Agenda', '0', '64', '1', '\n\n[7.1.1 INT Introduction NEW, PROPOSED ON 09/24/2013]\nThe following lesson covers the topic of mixed mesh. In this lesson, I will present mixed meshing, where you may assign different element types to different parts. In practical applications, as the number of parts increases in the assembly and you have all sorts of shapes, from bulky to thin and long, the capability of mixed meshing is particularly important. I will explain in detail, how the contact at the interface of mixed meshes must be set up, and what practical considerations should be made. It is assumed that by now you are already familiar with solid, shell and beam element types.\n\nThis mixed mesh lesson is divided into four [4] parts. Please watch all parts in the given order. I will now begin with part one [1]. This first part will provide introduction and begin with the solid mesh solution. The duration of this part is approximately twenty five minutes [25 minutes].', '0', '0');
INSERT INTO `cuepoints` VALUES ('603', '9287', 'CH', 'Model, Mesh discussion', '64', '184', '1', '\n\nAs the lesson for mixed meshing, I have chosen this chair assembly. It consists of four [4] distinct components: The seat; the leg; the connecting cones between the seat and the leg; ▐  and four [4] bolts that fasten the cones to the leg. The cone, even though it is small in size, it is a bulky part in terms of its relative dimensions. Therefore, it can only be meshed with solid elements. The seat is large in terms of area but small in terms of thickness, therefore I can use either solid or shell meshing for the seat. The leg is a long member with a small pipe-shaped cross section. Therefore, theoretically, I can use solid, shell or beam meshing for the leg. The chair assembly looks simple but it has all the ingredients for a mixed meshed model.\n\nIn SolidWorks, you can define a part as a multi-body part. In this example, I have modeled the seat and the connecting cones as a multi-body part, with four [4] bodies for the cones and one [1] body for the seat. Similarly, I have modeled the leg as a multi-body part with twenty two [22] bodies. In this lesson, I may use the word part, for example the cone part, even though in terms of cad [CAD] modeling, it is a body within the seat part the way it is modelled here.', '0', '0');
INSERT INTO `cuepoints` VALUES ('604', '9287', 'CH', 'Optimum model complexity', '184', '220', '1', '\n\n[PIP Optimum model complexity] When you do a numerical simulation, you may need to do some simplifications and make some assumptions. The extent of such simplifications and assumptions depend on many different factors. You do not want to do a very complicated simulation, even if you could, but you do not want to over-simplify the problem either. Where this \"fine\" balance is, depends on the specifics of your problem, your requirements, standards and other different factors. The most important factor is to formulate the right questions which the simulation must answer for you.', '0', '0');
INSERT INTO `cuepoints` VALUES ('605', '9287', 'CH', 'Simulation goal', '220', '235', '1', '\n \nIn this lesson, I want to address the following primary questions: Are the seat, the cones and the leg strong enough and do I see excessive deformation, for a given operational scenario.', '0', '0');
INSERT INTO `cuepoints` VALUES ('606', '9287', 'CH', 'Assumptions, Simplifications', '235', '297', '1', '\n\n▐  In this chair, we have four [4] bolts that fasten the leg to the cones. Also, appropriate adhesives are used to keep the seat attached to the cones. In general, a good design is such that if there was to be a failure in the future, it is in areas where the failure will show some advanced indications or warnings, such as cracks or excessive deformations. Sudden failures without warning are undesirable. ▐  Because failure of some of the connecting elements could trigger such sudden damage, I will assume that they are absolutely safe. Namely, I do not want for the bolts to fail and I will therefore assume that they are safe. Also I assume that the bonding of the seat to the cones is absolutely safe and functional. In general, it is always good if these connecting elements are over-designed. Therefore, for the purposes of this simulation, I will switch to a configuration where I have removed the bolts. I will ensure the effect of the bolts by defining the necessary bonding conditions.', '0', '0');
INSERT INTO `cuepoints` VALUES ('607', '9287', 'CH', 'Load', '297', '348', '1', '\n\nAnother item to decide is the loading on the chair. A typical chair undergoes different types of loads, people sitting upright, leaning back, overturning and so on. In this lesson, I consider one of these cases; that is a hundred kilogram [100 kg] person sitting upright on the following area of the seat, not leaning back, with his legs on the ground. I assume that twenty [20] percent of this weight is transferred by his legs to the ground. [PIP Chair load] ▉  Therefore, my loading scenario is the other eighty [80] percent, that is ▌ eighty kilograms [80 kg], or conservatively eight hundred newtons [800 N]  applied vertically to the seat. Please note that in the context of this lesson, I am not trying to find the worst case loading scenario for a chair. The loading represents a person heavier than average but not any particular extreme case.', '0', '0');
INSERT INTO `cuepoints` VALUES ('608', '9287', 'CH', 'Fixtures', '348', '379', '1', '\nIn terms of support on the ground, there could be different scenarios. A rigid ground; carpeting with different thicknesses; potential for sliding and so on. Again, based on the goals of this simulation, problem description and loading, ▐  I will choose to fully fix all segments of the leg that is on the ground. This is not just simple, it is more than adequate for the loading type we have.', '0', '0');
INSERT INTO `cuepoints` VALUES ('609', '9287', 'CH', 'Material', '379', '484', '1', '\nThe material properties have been assigned after creating the CAD geometry. The seat is from a blend of polycarbonate [PC] and A B S [ABS] plastic material.\n[INT Materials]\nBecause plastics exhibit great variety of stress-strain curve shapes, the term “yield strength” is not used very frequently. We typically establish a tensile strength design limit at a certain acceptable strain value. For this material, the design tensile strength is clearly this point, at approximately forty megapascals [40 MPa] on the stress axis and a strain value of zero point zero seventeen [0.017]. Beyond this point, this polycarbonate blend flows and deforms significantly to be considered for any practical use. The relationship is nearly linear up until this value so the basic linear elastic model is ideal. The elastic modulus for this portion of the curve is two point four gigapascals [2.4 GPa]. To assess a failure of this material, I will employ two criteria: the traditional von mises stress criterion which will be compared against the tensile strength of forty megapascals [40 MPa], and the maximum principal strain criterion limiting the maximum principal strain in the model to zero point zero seventeen [0.017]. \n\nThe four [4] cones are from stainless steel; and the leg is also from stainless steel. \n\n[PIP Materials - continuing...] The yield strength for our stainless steel is a hundred and seventy two megapascals [172 MPa], and its Young’s modulus is two hundred gigapascals [200 GPa]. Both materials are available in the standard SolidWorks material database.', '0', '0');
INSERT INTO `cuepoints` VALUES ('610', '9287', 'CH', 'Interference detection', '484', '568', '1', '\n\nBefore starting with my simulation studies, I want to make sure that my cad [CAD] geometry of this assembly is ready. Most importantly, I want to ensure that there are no interferences or undesired gaps where the parts or bodies come together. This is important when it comes to meshing and defining contacts. I will start SolidWorks Interference Detection. Because some parts are defined as multi-bodies I will check \"Include Multibody part interferences\". No interference is detected, which is good. I also want to make sure that there are no undesired gaps and all the surfaces that are supposed to be in contact are indeed in contact. So I will check \"Treat coincidence as interference\" and re-calculate interference detection. Many touching faces are found. These include the four [4] touching faces between the cones and the leg; the four [4] touching faces between the cones and the seat; and all the touching faces between the segments of the leg. So, the geometry is fine and I can exit “Interference detection”.', '0', '0');
INSERT INTO `cuepoints` VALUES ('611', '9287', 'CH', 'SOLID MESH STUDY', '568', '651', '1', '\n\n[PIP: Mixed Mesh of chair]\nI explained earlier that different types of mixed mesh can be adopted for the chair. [PIP Mixed mesh]  I get the smallest size of a simulation problem if I chose solid for the cones, shell for the seat and beam for the leg. But as the first study, I want to choose an all solid meshing. The benefit of this approach is that it gives me a good sense of the complexity of the problem. It is straightforward to setup, the geometry is clean, and this particular problem is not too big. Looking at the geometry, loading and supports, I can model half of the geometry and take advantage of symmetry. I choose not to. For the educational purposes here and also for better postprocessing and visualization, it is easier to work with the full model.\n\nI will create a new static study and name it solid one [Solid1]. All bodies in the leg are treated as solid; and the stainless steel material is automatically brought in from the cad model. Similar for the seat, all components are treated as solid, ABS [ABS] polycarbonate and stainless steel are brought in and assigned correctly.', '0', '0');
INSERT INTO `cuepoints` VALUES ('612', '9287', 'CH', 'Contacts, Fixtures, Load', '651', '721', '1', '\n\n I will leave the global contact as default bonded. Because all components are touching and will be meshed with solid elements, the bonded contact will ensure that all surfaces on the interfaces that you saw previously during the interference detection will be kept together. I can go ahead with fixtures and loads. I will define a fixed geometry fixture on the portions of the leg touching the floor. Next I will apply the force. I will select all portions of the seat that the person sitting upright will touch, check “total” and specify the magnitude of eight hundred newtons [800 N]. ▌  For clarity, I will switch the simulation symbols off.', '0', '0');
INSERT INTO `cuepoints` VALUES ('613', '9287', 'CH', 'Mesh, Solution', '721', '813', '1', '\n\n I can go ahead and mesh the model. I will move the mesh factor all the way to the right; ▲  the element size will be set to about eleven millimeters [11 mm]. I will also keep the standard mesher, because I prefer to have a more homogeneous mesh in this model. The meshing process will fail. Some chair components have smaller cross sections like the thickness of the pipe-shaped leg, and the thickness of the seat. Even though the mesh factor was at its finest setting, the element size is too large and will result in portions of the leg to fail to mesh. I do not want to apply any mesh controls at this point, the goal is to run a quick initial study. I will therefore mesh the model again and reduce the global size to eight [8] millimeters. That would be the largest size, to uniformly mesh the complete model without any mesh control. This time meshing is successful. The program creates a total of about one hundred fifty thousand [150,000] nodes. I can go ahead and run the study.', '0', '0');
INSERT INTO `cuepoints` VALUES ('614', '9287', 'CH', 'Displacements', '813', '871', '1', '\nI will first look at the displacement plot. To get a more realistic view, I will change the default magnified displacement plot to true scale of one [1]; go to the plot settings and superimpose model on the deformed shape; and look at the model from the side. ▲ The maximum displacement in the model is twenty three [23] millimeters, and as expected, is at the top of the seat. ▌  ▌  To get the maximum displacement of the leg I will probe the displacement plot at the back of the chair. The maximum deflection in the leg portion is ten point eight millimeters [10.8mm].', '0', '0');
INSERT INTO `cuepoints` VALUES ('615', '9287', 'CH', 'Stresses: Seat, cones', '871', '975', '1', '\n\nI will now look at the stresses in more detail. ▲  The highest stress is in the area of the curved region of the leg closer to the ground. The maximum stress is one hundred and sixty megapascals [160 MPa]. Because I have three [3] distinct parts, that is the seat, the cones and the leg, I will have to look at their stresses separately. Under Chart Options, I will activate showing the range on shown parts only. I will edit the plot, and under the advanced options, I will check “show plot only on selected entities”. I will pin the stress plot property manager because I will use it now a few times. I will first select the seat body, and click OK to regenerate the plot. The maximum stress is nine point five megapascals [9.5 MPa] ▲  with the peak at the contact area to the cone. This is much smaller that the polycarbonate design limit of forty megapascals [40 MPa]. For now I will focus on stress criterion only. The second criterion based on the principal strain will be checked later.\nNext I will select the four cones. Their maximum stress is forty four megapascals [44 MPa], ▲with a peak at the contact area to the leg. Again, the value here is much smaller than the design limit for stainless steel of a hundred and seventy two megapascals [172 MPa].', '1', '0');
INSERT INTO `cuepoints` VALUES ('616', '9287', 'CH', 'Stresses: Leg', '975', '1017', '1', '\n\nLastly, I will select all leg components. The maximum stress is back to a hundred and sixty megapascals [160 MPa]. ▲  The peak is located at the lower bent region on the back of the leg. Clearly the leg is stressed the most, but also here the maximum stress is below the stainless steel design limit of a hundred and seventy two megapascals [172 MPa].', '0', '0');
INSERT INTO `cuepoints` VALUES ('617', '9287', 'CH', 'Results: Discussion', '1017', '1048', '1', '\n\nOverall, comparing these maximum stress values with the respective limiting values defined in the material properties, and accounting for localized stress concentrations, I see that for the given problem definition and assumptions, the design seems to be safe in the initial evaluation. However, the mesh is very coarse so under no circumstances I would feel confident to consider these results as final. A  better model is required to ensure converged reliable results.', '0', '0');
INSERT INTO `cuepoints` VALUES ('618', '9287', 'CH', 'Mesh review: Part 1', '1048', '1156', '1', '\n\nOk. I now have a better understanding of my overall simulation problem. I will first show the mesh and review its suitability for this model. In terms of modeling and meshing, the least number of nodes is about one hundred fifty thousand [150,000] with a solid mesh overall, and a global element size of eight [8] millimeters. The thickness of the seat is eight millimeters [8mm]. ▌ ▐  ▲  Even though some extra elements were generated to accommodate the fillets around the seat, it was meshed with only one solid element through the cross section. While this may be sufficient for some parts of the seat, it is unacceptable for  ▐  highly stressed regions which can be bent or sheared, such as ▲  these glued cone to seat interfaces. I will now hide the mesh and switch to the model tab. In order to check the mesh inside the parts I will hide one cone; and one segment of the leg. ▐  I will go back to the simulation study, show the mesh again and review the leg. Pipe-shaped leg has thickness of two millimeters [2mm] and it was also meshed with only one [1] solid element in the cross section. I will also zoom towards the removed cone area. This region also has only one [1] solid element through the thickness of the seat.', '0', '0');
INSERT INTO `cuepoints` VALUES ('619', '9287', 'CH', 'Fine solid mesh', '1156', '1277', '1', '\n\nAs I mentioned earlier, having just one [1] element to model the cross section of a thin part under bending or in shear is clearly not enough. So, I will create a new solid study; and generate a finer mesh everywhere. I will change the element size to four [4] millimeters, half the value I used previously. Meshing takes significantly more time. The number of nodes increase five [5] fold, to seven hundred fifty thousand [750,000]. ▐  Looking at the mesh for the seat and ignoring the elements needed to accommodate the localized fillet, I see that the element count in the cross section has increased from one [1] to two [2]. This may still not be enough for this region where the seat connects to the cones. While the bonding material is assumed very strong, the seat plastic material adjacent to the connection can be severely stressed in shear and prone to failure. More elements would certainly be required here. For the leg pipe, there is still one [1] solid element in the cross section. You can see that it would be extremely difficult to generate more elements in the wall of the pipe. Their size would have to be very small. This mesh review clearly shows that a fine mesh with solid elements is practically out of question.', '1', '0');
INSERT INTO `cuepoints` VALUES ('620', '9287', 'CH', 'Bent, sheared structures: Min # of elements', '1277', '1392', '1', '\n\nNow, it turns out that the leg pipes, while being loaded in bending, do not actually require multiple solid elements meshing their wall thickness. Here is why.  \n[PIP Pipes in bending] The requirement for having more than one element in the cross section of thin parts under bending should be viewed in context. If you analyze a thin plate under bending, having one element in thickness is almost always inaccurate. Looking at the cross-section, the neutral axis is typically assumed passing through the center. When bent, the top is in tension, the bottom is in compression. To capture the stress variation from the top to the bottom, especially if you face more complex loading, multiple solid elements are required. It is typically recommended to have at least three [3] high quality elements. Now, a beam with a hollow cross section such as this box example, does not require as many elements in its flanges. The top flange is predominantly loaded in tension, while the bottom flange is in compression, and so the stress gradient in each flange is relatively small. In simple terms, you can almost view this as a simple tension state in the top flange, and compression in the bottom flange. The corners and the two webs will obviously be loaded in more complex fashion because the stress must transition from the tensile top to the compressed bottom. But then typically there are always at least a few elements on the sides of the neutral axis in the webs across their heights. \nOf course, should the box beam be loaded in a more complex fashion, such as torsion, finer mesh would be required. For simple bending, however, fairly coarse mesh will perform quite well. \n\nA pipe cross-section used in the chair model behaves in a similar way. Therefore, meshing it with only one element may not be much of a concern.', '0', '0');
INSERT INTO `cuepoints` VALUES ('621', '9287', 'CH', 'Mesh review: Part 2', '1392', '0', '1', '\n\nFurthermore, for this problem, having higher number of elements in the thickness of the seat is actually not critical in the most parts of its geometry.  ▌I will show the stress plot again. Looking at the stress distribution in the seat, I see that the seat, for the most part, is not a critical part in this study. [Severely bent chair]  It would have been, if I considered a horizontal force on the seat, because of somebody leaning back. Bending stresses and displacements would increase considerably, and a good mesh with multiple solid elements through the thickness would be necessary. You would find out that the total number of elements would in fact increase so much, that a use of shell elements would be the only practical solution. \nThe exception is the ▌ region near the cone where the seat exhibits larger shear stresses. The higher stresses here are not easily visible in this view because the legend maximum is set to the model maximum, and so even higher stresses around the cone are still plotted in blue. This region is important, however, and a good quality mesh able to capture the significant shear stresses here is important in this problem.\nAs for the leg, ▐  the portions of the leg that are fixed are not significant either. But the rest of the leg, and ▌ ▲  especially the curved regions under higher stress located on the back sides are important\nAll the observations above bring us to the conclusion that mixed meshing is important, even for this example which is not that complicated.', '0', '0');
INSERT INTO `cuepoints` VALUES ('622', '9500', 'CH', 'Introduction, Agenda', '0', '64', '1', '\n\n[7.1.1 INT Introduction NEW, PROPOSED ON 09/24/2013]\nThe following lesson covers the topic of mixed mesh. In this lesson, I will present mixed meshing, where you may assign different element types to different parts. In practical applications, as the number of parts increases in the assembly and you have all sorts of shapes, from bulky to thin and long, the capability of mixed meshing is particularly important. I will explain in detail, how the contact at the interface of mixed meshes must be set up, and what practical considerations should be made. It is assumed that by now you are already familiar with solid, shell and beam element types.\n\nThis mixed mesh lesson is divided into four [4] parts. Please watch all parts in the given order. I will now begin with part one [1]. This first part will provide introduction and begin with the solid mesh solution. The duration of this part is approximately twenty five minutes [25 minutes].', '0', '0');
INSERT INTO `cuepoints` VALUES ('623', '9500', 'CH', 'Model, Mesh discussion', '64', '184', '1', '\n\nAs the lesson for mixed meshing, I have chosen this chair assembly. It consists of four [4] distinct components: The seat; the leg; the connecting cones between the seat and the leg; ▐  and four [4] bolts that fasten the cones to the leg. The cone, even though it is small in size, it is a bulky part in terms of its relative dimensions. Therefore, it can only be meshed with solid elements. The seat is large in terms of area but small in terms of thickness, therefore I can use either solid or shell meshing for the seat. The leg is a long member with a small pipe-shaped cross section. Therefore, theoretically, I can use solid, shell or beam meshing for the leg. The chair assembly looks simple but it has all the ingredients for a mixed meshed model.\n\nIn SolidWorks, you can define a part as a multi-body part. In this example, I have modeled the seat and the connecting cones as a multi-body part, with four [4] bodies for the cones and one [1] body for the seat. Similarly, I have modeled the leg as a multi-body part with twenty two [22] bodies. In this lesson, I may use the word part, for example the cone part, even though in terms of cad [CAD] modeling, it is a body within the seat part the way it is modelled here.', '0', '0');
INSERT INTO `cuepoints` VALUES ('624', '9500', 'CH', 'Optimum model complexity', '184', '220', '1', '\n\n[PIP Optimum model complexity] When you do a numerical simulation, you may need to do some simplifications and make some assumptions. The extent of such simplifications and assumptions depend on many different factors. You do not want to do a very complicated simulation, even if you could, but you do not want to over-simplify the problem either. Where this \"fine\" balance is, depends on the specifics of your problem, your requirements, standards and other different factors. The most important factor is to formulate the right questions which the simulation must answer for you.', '0', '0');
INSERT INTO `cuepoints` VALUES ('625', '9500', 'CH', 'Simulation goal', '220', '235', '1', '\n \nIn this lesson, I want to address the following primary questions: Are the seat, the cones and the leg strong enough and do I see excessive deformation, for a given operational scenario.', '0', '0');
INSERT INTO `cuepoints` VALUES ('626', '9500', 'CH', 'Assumptions, Simplifications', '235', '297', '1', '\n\n▐  In this chair, we have four [4] bolts that fasten the leg to the cones. Also, appropriate adhesives are used to keep the seat attached to the cones. In general, a good design is such that if there was to be a failure in the future, it is in areas where the failure will show some advanced indications or warnings, such as cracks or excessive deformations. Sudden failures without warning are undesirable. ▐  Because failure of some of the connecting elements could trigger such sudden damage, I will assume that they are absolutely safe. Namely, I do not want for the bolts to fail and I will therefore assume that they are safe. Also I assume that the bonding of the seat to the cones is absolutely safe and functional. In general, it is always good if these connecting elements are over-designed. Therefore, for the purposes of this simulation, I will switch to a configuration where I have removed the bolts. I will ensure the effect of the bolts by defining the necessary bonding conditions.', '0', '0');
INSERT INTO `cuepoints` VALUES ('627', '9500', 'CH', 'Load', '297', '348', '1', '\n\nAnother item to decide is the loading on the chair. A typical chair undergoes different types of loads, people sitting upright, leaning back, overturning and so on. In this lesson, I consider one of these cases; that is a hundred kilogram [100 kg] person sitting upright on the following area of the seat, not leaning back, with his legs on the ground. I assume that twenty [20] percent of this weight is transferred by his legs to the ground. [PIP Chair load] ▉  Therefore, my loading scenario is the other eighty [80] percent, that is ▌ eighty kilograms [80 kg], or conservatively eight hundred newtons [800 N]  applied vertically to the seat. Please note that in the context of this lesson, I am not trying to find the worst case loading scenario for a chair. The loading represents a person heavier than average but not any particular extreme case.', '0', '0');
INSERT INTO `cuepoints` VALUES ('628', '9500', 'CH', 'Fixtures', '348', '379', '1', '\nIn terms of support on the ground, there could be different scenarios. A rigid ground; carpeting with different thicknesses; potential for sliding and so on. Again, based on the goals of this simulation, problem description and loading, ▐  I will choose to fully fix all segments of the leg that is on the ground. This is not just simple, it is more than adequate for the loading type we have.', '0', '0');
INSERT INTO `cuepoints` VALUES ('629', '9500', 'CH', 'Material', '379', '484', '1', '\nThe material properties have been assigned after creating the CAD geometry. The seat is from a blend of polycarbonate [PC] and A B S [ABS] plastic material.\n[INT Materials]\nBecause plastics exhibit great variety of stress-strain curve shapes, the term “yield strength” is not used very frequently. We typically establish a tensile strength design limit at a certain acceptable strain value. For this material, the design tensile strength is clearly this point, at approximately forty megapascals [40 MPa] on the stress axis and a strain value of zero point zero seventeen [0.017]. Beyond this point, this polycarbonate blend flows and deforms significantly to be considered for any practical use. The relationship is nearly linear up until this value so the basic linear elastic model is ideal. The elastic modulus for this portion of the curve is two point four gigapascals [2.4 GPa]. To assess a failure of this material, I will employ two criteria: the traditional von mises stress criterion which will be compared against the tensile strength of forty megapascals [40 MPa], and the maximum principal strain criterion limiting the maximum principal strain in the model to zero point zero seventeen [0.017]. \n\nThe four [4] cones are from stainless steel; and the leg is also from stainless steel. \n\n[PIP Materials - continuing...] The yield strength for our stainless steel is a hundred and seventy two megapascals [172 MPa], and its Young’s modulus is two hundred gigapascals [200 GPa]. Both materials are available in the standard SolidWorks material database.', '0', '0');
INSERT INTO `cuepoints` VALUES ('630', '9500', 'CH', 'Interference detection', '484', '568', '1', '\n\nBefore starting with my simulation studies, I want to make sure that my cad [CAD] geometry of this assembly is ready. Most importantly, I want to ensure that there are no interferences or undesired gaps where the parts or bodies come together. This is important when it comes to meshing and defining contacts. I will start SolidWorks Interference Detection. Because some parts are defined as multi-bodies I will check \"Include Multibody part interferences\". No interference is detected, which is good. I also want to make sure that there are no undesired gaps and all the surfaces that are supposed to be in contact are indeed in contact. So I will check \"Treat coincidence as interference\" and re-calculate interference detection. Many touching faces are found. These include the four [4] touching faces between the cones and the leg; the four [4] touching faces between the cones and the seat; and all the touching faces between the segments of the leg. So, the geometry is fine and I can exit “Interference detection”.', '0', '0');
INSERT INTO `cuepoints` VALUES ('631', '9500', 'CH', 'SOLID MESH STUDY', '568', '651', '1', '\n\n[PIP: Mixed Mesh of chair]\nI explained earlier that different types of mixed mesh can be adopted for the chair. [PIP Mixed mesh]  I get the smallest size of a simulation problem if I chose solid for the cones, shell for the seat and beam for the leg. But as the first study, I want to choose an all solid meshing. The benefit of this approach is that it gives me a good sense of the complexity of the problem. It is straightforward to setup, the geometry is clean, and this particular problem is not too big. Looking at the geometry, loading and supports, I can model half of the geometry and take advantage of symmetry. I choose not to. For the educational purposes here and also for better postprocessing and visualization, it is easier to work with the full model.\n\nI will create a new static study and name it solid one [Solid1]. All bodies in the leg are treated as solid; and the stainless steel material is automatically brought in from the cad model. Similar for the seat, all components are treated as solid, ABS [ABS] polycarbonate and stainless steel are brought in and assigned correctly.', '0', '0');
INSERT INTO `cuepoints` VALUES ('632', '9500', 'CH', 'Contacts, Fixtures, Load', '651', '721', '1', '\n\n I will leave the global contact as default bonded. Because all components are touching and will be meshed with solid elements, the bonded contact will ensure that all surfaces on the interfaces that you saw previously during the interference detection will be kept together. I can go ahead with fixtures and loads. I will define a fixed geometry fixture on the portions of the leg touching the floor. Next I will apply the force. I will select all portions of the seat that the person sitting upright will touch, check “total” and specify the magnitude of eight hundred newtons [800 N]. ▌  For clarity, I will switch the simulation symbols off.', '0', '0');
