INSERT INTO `cuepoints` VALUES ('636', '9500', 'CH', 'Stresses: Leg', '975', '1017', '1', '\n\nLastly, I will select all leg components. The maximum stress is back to a hundred and sixty megapascals [160 MPa]. ▲  The peak is located at the lower bent region on the back of the leg. Clearly the leg is stressed the most, but also here the maximum stress is below the stainless steel design limit of a hundred and seventy two megapascals [172 MPa].', '0', '0');
INSERT INTO `cuepoints` VALUES ('637', '9500', 'CH', 'Results: Discussion', '1017', '1048', '1', '\n\nOverall, comparing these maximum stress values with the respective limiting values defined in the material properties, and accounting for localized stress concentrations, I see that for the given problem definition and assumptions, the design seems to be safe in the initial evaluation. However, the mesh is very coarse so under no circumstances I would feel confident to consider these results as final. A  better model is required to ensure converged reliable results.', '0', '0');
INSERT INTO `cuepoints` VALUES ('638', '9500', 'CH', 'Mesh review: Part 1', '1048', '1156', '1', '\n\nOk. I now have a better understanding of my overall simulation problem. I will first show the mesh and review its suitability for this model. In terms of modeling and meshing, the least number of nodes is about one hundred fifty thousand [150,000] with a solid mesh overall, and a global element size of eight [8] millimeters. The thickness of the seat is eight millimeters [8mm]. ▌ ▐  ▲  Even though some extra elements were generated to accommodate the fillets around the seat, it was meshed with only one solid element through the cross section. While this may be sufficient for some parts of the seat, it is unacceptable for  ▐  highly stressed regions which can be bent or sheared, such as ▲  these glued cone to seat interfaces. I will now hide the mesh and switch to the model tab. In order to check the mesh inside the parts I will hide one cone; and one segment of the leg. ▐  I will go back to the simulation study, show the mesh again and review the leg. Pipe-shaped leg has thickness of two millimeters [2mm] and it was also meshed with only one [1] solid element in the cross section. I will also zoom towards the removed cone area. This region also has only one [1] solid element through the thickness of the seat.', '0', '0');
INSERT INTO `cuepoints` VALUES ('639', '9500', 'CH', 'Fine solid mesh', '1156', '1277', '1', '\n\nAs I mentioned earlier, having just one [1] element to model the cross section of a thin part under bending or in shear is clearly not enough. So, I will create a new solid study; and generate a finer mesh everywhere. I will change the element size to four [4] millimeters, half the value I used previously. Meshing takes significantly more time. The number of nodes increase five [5] fold, to seven hundred fifty thousand [750,000]. ▐  Looking at the mesh for the seat and ignoring the elements needed to accommodate the localized fillet, I see that the element count in the cross section has increased from one [1] to two [2]. This may still not be enough for this region where the seat connects to the cones. While the bonding material is assumed very strong, the seat plastic material adjacent to the connection can be severely stressed in shear and prone to failure. More elements would certainly be required here. For the leg pipe, there is still one [1] solid element in the cross section. You can see that it would be extremely difficult to generate more elements in the wall of the pipe. Their size would have to be very small. This mesh review clearly shows that a fine mesh with solid elements is practically out of question.', '0', '0');
INSERT INTO `cuepoints` VALUES ('640', '9500', 'CH', 'Bent, sheared structures: Min # of elements', '1277', '1392', '1', '\n\nNow, it turns out that the leg pipes, while being loaded in bending, do not actually require multiple solid elements meshing their wall thickness. Here is why.  \n[PIP Pipes in bending] The requirement for having more than one element in the cross section of thin parts under bending should be viewed in context. If you analyze a thin plate under bending, having one element in thickness is almost always inaccurate. Looking at the cross-section, the neutral axis is typically assumed passing through the center. When bent, the top is in tension, the bottom is in compression. To capture the stress variation from the top to the bottom, especially if you face more complex loading, multiple solid elements are required. It is typically recommended to have at least three [3] high quality elements. Now, a beam with a hollow cross section such as this box example, does not require as many elements in its flanges. The top flange is predominantly loaded in tension, while the bottom flange is in compression, and so the stress gradient in each flange is relatively small. In simple terms, you can almost view this as a simple tension state in the top flange, and compression in the bottom flange. The corners and the two webs will obviously be loaded in more complex fashion because the stress must transition from the tensile top to the compressed bottom. But then typically there are always at least a few elements on the sides of the neutral axis in the webs across their heights. \nOf course, should the box beam be loaded in a more complex fashion, such as torsion, finer mesh would be required. For simple bending, however, fairly coarse mesh will perform quite well. \n\nA pipe cross-section used in the chair model behaves in a similar way. Therefore, meshing it with only one element may not be much of a concern.', '0', '0');
INSERT INTO `cuepoints` VALUES ('641', '9500', 'CH', 'Mesh review: Part 2', '1392', '0', '1', '\n\nFurthermore, for this problem, having higher number of elements in the thickness of the seat is actually not critical in the most parts of its geometry.  ▌I will show the stress plot again. Looking at the stress distribution in the seat, I see that the seat, for the most part, is not a critical part in this study. [Severely bent chair]  It would have been, if I considered a horizontal force on the seat, because of somebody leaning back. Bending stresses and displacements would increase considerably, and a good mesh with multiple solid elements through the thickness would be necessary. You would find out that the total number of elements would in fact increase so much, that a use of shell elements would be the only practical solution. \nThe exception is the ▌ region near the cone where the seat exhibits larger shear stresses. The higher stresses here are not easily visible in this view because the legend maximum is set to the model maximum, and so even higher stresses around the cone are still plotted in blue. This region is important, however, and a good quality mesh able to capture the significant shear stresses here is important in this problem.\nAs for the leg, ▐  the portions of the leg that are fixed are not significant either. But the rest of the leg, and ▌ ▲  especially the curved regions under higher stress located on the back sides are important\nAll the observations above bring us to the conclusion that mixed meshing is important, even for this example which is not that complicated.', '0', '0');
