INSERT INTO `products` VALUES ('17', '0', '3172', '1', '0', '0', '0', '1', '9379', 'Course1501 duplicate', null, 'Since a shell is a 2D element, it can be applied to pure surfaces in SolidWorks. In fact, it is more accurate to define a surface to represent the shell in the model itself than is it to select a face of the solid. The thicker the part, the more important it is to create this mid-surface. SolidWorks Simulation understands the surface you select to define the shell as the mid-surface of the part. Luckily, there is a command named \"Mid-Surface\" which allows us to create a surface from a solid part at the proper location.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '1', '0', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', '0', '0.000', '0', '0', '0', '0', '', '1', '1', '0', '', '', '', '20', '156');
INSERT INTO `products` VALUES ('18', '0', '3172', '1', '0', '0', '0', '1', '9395', 'Course1501_2', null, 'On the auto bonding of beam and shells. The face of shell to a beam works most of the time (ex being a stiffened shell). The edge of shell to a beam is not supported. You will have to make a manual connection bonding the beam to the face of the shell (as the target). The span of the joint will be handled reasonably well by the mortar bonding. Same would apply to a beam and a solid.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '1', '0', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', '0', '0.000', '0', '0', '0', '0', '', '1', '1', '0', '', '', '', '20', '156');
INSERT INTO `products` VALUES ('19', '0', '3172', '1', '0', '0', '0', '1', '9401', 'Course1501_3', null, ' we will discuss the best way to create geometry that is ready for a robust shell mesh. Once a few of the thin-walled sheets or plates are changed to shells, there is immediate relief. Shells are 2D elements which idealize the thickness direction', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '1', '0', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', '0', '0.000', '0', '0', '0', '0', '', '1', '1', '0', '', '', '', '20', '156');
INSERT INTO `products` VALUES ('20', '0', '3172', '1', '0', '0', '0', '1', '9407', 'Course1501_4', null, 'A solid element would give you more accurate result than shell element. I believe you want to use a shell element as to find an optimum thickness for your structure. If I am not wrong analysis programs are set up to run in shell elements so that the thickness can be controlled (some programs can give the required thickness for a particular force). However my advice is when running SolidWorks, since it’s more like a design validation tool, to use solid elements.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '1', '0', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', '0', '0.000', '0', '0', '0', '0', '', '1', '1', '0', '', '', '', '20', '156');
