INSERT INTO `products` VALUES ('22', '0', '9274', '1', '0', '0', '0', '1', '9498', 'Course Sim Beams', null, 'This content is a lecture and no training files are supplied with it. Please, view it in its entirety. If necessary take notes or ask questions to your instructor.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '1', '0', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', '0', '0.000', '0', '0', '0', '0', '', '0', '1', '0', '', '', '', '20', '156');
INSERT INTO `products` VALUES ('23', '0', '9274', '1', '0', '0', '0', '1', '9510', 'Course Sim Beams Quiz', null, 'It is a course of 6 Lessons and 5 Quizzes. Passing score is required some quizzes.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '1', '0', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', '0', '0.000', '0', '0', '0', '0', '', '1', '1', '0', '', '', '', '20', '156');
INSERT INTO `products` VALUES ('24', '0', '9613', '1', '0', '0', '0', '1', '9634', 'Course 1', null, 'The following lesson covers the topic of beam mesh. In this lesson, I will introduce you to the beam line element. In practical applications with many long and slender members, beam element is essential because of its efficiency. I will cover the basic concepts such as the beam joints, beam meshing, and application of fixtures and loads. I will discuss the beam to joint connections, and I will of course also show you postprocessing. Because postprocessing beams is a little more involved, I will additionally cover in detail the beam stress types, and I will show you an example of a beam validation procedure.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '1', '0', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', '0', '0.000', '0', '0', '0', '0', '', '0', '1', '0', '', '', '', '20', '156');
INSERT INTO `products` VALUES ('25', '0', '9613', '1', '0', '0', '0', '1', '9980', 'Sim Beams Course 1', null, 'The following lesson covers the topic of beam mesh. In this lesson, I will introduce you to the beam line element. In practical applications with many long and slender members, beam element is essential because of its efficiency. I will cover the basic concepts such as the beam joints, beam meshing, and application of fixtures and loads. I will discuss the beam to joint connections, and I will of course also show you postprocessing. Because postprocessing beams is a little more involved, I will additionally cover in detail the beam stress types, and I will show you an example of a beam validation procedure.\n\nThis beam mesh lesson is divided into five [5] parts. The following lesson covers the topic of beam mesh, and is divided into five [5] parts. Please watch all parts in the given order. I will       now begin with part one [1]. This first part will demonstrate a limited applicability of solid mesh in slender long members, and it will also help me establish a solution reference. The duration of this part is approximately fifteen minutes [15 minutes].', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '1', '0', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', '0', '0.000', '0', '0', '0', '0', '', '0', '1', '0', '', '', '', '20', '156');
INSERT INTO `products` VALUES ('26', '0', '3172', '1', '0', '0', '0', '1', '10000', 'Meshing course', null, 'The quality of mesh plays a key role in the accuracy of the results. The software uses two important checks to measure the quality of elements in a mesh.\n\nAspect Ratio Check. For a solid mesh, numerical accuracy is best achieved by a mesh with uniform perfect tetrahedral elements whose edges are equal in length. For a general geometry, it is not possible to create a mesh of perfect tetrahedral elements. Due to small edges, curved geometry, thin features, and sharp corners, some of the generated elements can have some of their edges much longer than others. When the edges of an element become much different in length, the accuracy of the results deteriorates.\n\nThe aspect ratio of a perfect tetrahedral element is used as the basis for calculating aspect ratios of other elements. The aspect ratio of an element is defined as the ratio between the longest edge and the shortest normal dropped from a vertex to the opposite face normalized with respect to a perfect tetrahedral. By definition, the aspect ratio of a perfect tetrahedral element is 1.0. The aspect ratio check assumes straight edges connecting the four corner nodes. The aspect ratio check is automatically used by the program to check the quality of the mesh.', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '0', '0', '0', '0', '0', '0', '0', '0.00', '0', '0', '0', '0', '0.000', '0', '0', '0', '0', '', '0', '1', '0', '', '', '', '20', '156');
