INSERT INTO `quizes` VALUES ('1', '1', 'Q1', 'Beam  mesh element is primarily designed for long slender members. What is the minimum recommended ratio of its length versus the larger cross-sectional dimension (L/h)? For ratios smaller than this recommended minimum, accuracy of the beam element will progressively degrade.', '', null, '2013-12-16 06:20:47', null, null, null, 'multiple choice', '0', '0', '[{\"uid\":\"https://swpuat.s3.amazonaws.com/images%2FComponents%2F161%2FB1.jpg\",\"text\":\"B1.jpg\",\"imagePath\":\"https://swpuat.s3.amazonaws.com/images%2FComponents%2F161%2FB1.jpg\"}]', '', '179', '0', '3', '255', '[{\"uid\":\"images\\/workingfiles\\/161\\/B1.SLDPRT\",\"text\":\"B1.SLDPRT\",\"Date\":\"2013-12-16 06:25:16\",\"imagePath\":\"https:\\/\\/swpuat.s3.amazonaws.com\\/images%2Fworkingfiles%2F161%2FB1.SLDPRT\"}]', '0');
INSERT INTO `quizes` VALUES ('2', '1', 'Q2', 'Beam elements are referred to as structural elements, because … (choose all that apply)', '', null, '2013-12-16 06:25:25', null, null, null, 'multiple choice', '0', '10', '[]', '', '179', '0', '3', '255', '[]', '0');
INSERT INTO `quizes` VALUES ('3', '1', 'Q3', 'Open the model B3.sldprt in SolidWorks. This model was created using extruded bodies. Convert all its members into beams. Apply vertical forces of 500 N at each of the top 4 joints, apply fixed geometry fixtures at the bottom 4 joints, and solve the problem. Use the default mesh. What is the resulting maximum displacement? (Use millimeters, round your answer to 4 decimal points)', '', null, '2013-12-16 06:32:20', null, null, null, 'multiple choice', '0', '20', '[{\"uid\":\"https://swpuat.s3.amazonaws.com/images%2FComponents%2F161%2FB3.jpg\",\"text\":\"B3.jpg\",\"imagePath\":\"https://swpuat.s3.amazonaws.com/images%2FComponents%2F161%2FB3.jpg\"}]', '', '0', '0', '3', '255', '[{\"uid\":\"images\\/workingfiles\\/161\\/B3.SLDPRT\",\"text\":\"B3.SLDPRT\",\"Date\":\"2013-12-16 06:34:23\",\"imagePath\":\"https:\\/\\/swpuat.s3.amazonaws.com\\/images%2Fworkingfiles%2F161%2FB3.SLDPRT\"}]', '0');
INSERT INTO `quizes` VALUES ('4', '1', 'Q4', 'In the frame model shown in the image, the beams were not properly trimmed or resolved, partly because they were constructed using solid extrusions, and not weldments. Before proceeding with a beam mesh simulation, ... ', '', null, '2013-12-16 06:37:55', null, null, null, 'multiple choice', '0', '30', '[{\"text\":\"B4.jpg\",\"uid\":\"https://swpuat.s3.amazonaws.com/images%2FComponents%2F161%2FB4.jpg\",\"imagePath\":\"https://swpuat.s3.amazonaws.com/images%2FComponents%2F161%2FB4.jpg\"}]', '', '689', '0', '3', '255', '[]', '0');
INSERT INTO `quizes` VALUES ('5', '1', 'Q5', 'Each beam element features 2 end points. At each endpoint, beam element features the following degrees of freedom.', '', null, '2013-12-16 06:40:16', null, null, null, 'multiple choice', '0', '40', '[]', '', '179', '0', '3', '255', '[]', '0');
INSERT INTO `quizes` VALUES ('6', '1', 'Q6', 'By default , SolidWorks simulation will generate joints at connections for all touching members only if these members are modelled using weldments.', '', null, '2013-12-16 06:43:31', null, null, null, 'multiple choice', '0', '50', '[]', '', '286', '0', '3', '255', '[]', '0');
INSERT INTO `quizes` VALUES ('7', '1', 'Q7', 'Neutral axis of a beam is a true location of the beam line mesh. It passes through the centroid of the beam cross-section.', '', null, '2013-12-16 06:44:25', null, null, null, 'multiple choice', '0', '60', '[]', '', '286', '0', '3', '255', '[]', '0');
INSERT INTO `quizes` VALUES ('8', '1', 'Q8', 'Distributed loads applied on a flange of a 3D beam may cause torsional moment. In classical beams, this distributed load is however assumed to pass through the  [ANSWER]. As such, this torsional effect of a distributed load is neglected. In most situations this is perfectly ok.', '', null, '2013-12-16 06:45:49', null, null, null, 'multiple choice', '0', '70', '[]', '', '1265', '0', '3', '255', '[]', '0');
INSERT INTO `quizes` VALUES ('9', '1', 'Q9', 'Beam joints are painted by using two colours: magenta and yellow. Yellow joints are connected to an endpoint of only one beam. Magenta joints are connected to endpoints of two or more beams.', '', null, '2013-12-16 06:48:39', null, null, null, 'multiple choice', '0', '80', '[]', '', '544', '0', '3', '255', '[]', '0');
