INSERT INTO `quizes` VALUES ('20', '1', 'Q1', 'Open the attached model B19.sldprt. Setup a static study. Define proper joints for the welded connection, define the fixed geometry fixture at the far end of the long beam, and a force of 350 N at the end joint of the short angle beam. Calculate the study using the default mesh. Assume, that the maximum allowable normal stress is 0.6 times the design limit, and the maximum allowable shear stress is 0.4 times the design limit. Factor of safety for this product is requested as 1.5. The members are made from mild steel with the yield strength of 220 MPa. Is the long beam safe for the operational load?', '', null, '2013-12-16 07:29:09', null, null, null, 'multiple choice', '0', '0', '[{\"uid\":\"https://swpuat.s3.amazonaws.com/images%2FComponents%2F161%2FB19.jpg\",\"text\":\"B19.jpg\",\"imagePath\":\"https://swpuat.s3.amazonaws.com/images%2FComponents%2F161%2FB19.jpg\"}]', '', '0', '0', '6', '288', '[{\"uid\":\"images\\/workingfiles\\/161\\/B19.SLDPRT\",\"text\":\"B19.SLDPRT\",\"Date\":\"2013-12-16 07:32:10\",\"imagePath\":\"https:\\/\\/swpuat.s3.amazonaws.com\\/images%2Fworkingfiles%2F161%2FB19.SLDPRT\"}]', '0');
INSERT INTO `quizes` VALUES ('21', '1', 'Q2', 'Open B20.sldprt attached to this question. Define a new static study. Define a fixed geometry fixture at one end joint, and a vertical force of 2000 N at the opposite end joint. Calculate the study using the default mesh. Assume, that the maximum allowable normal stress is 0.6 times the design limit, and the maximum allowable shear stress is 0.4 times the design limit. FOS for this product is 1.5. The beam is made from mild steel with the yield strength of 220 MPa. Is the beam safe for the specified operational load?', '', null, '2013-12-16 07:32:46', null, null, null, 'multiple choice', '0', '10', '[]', '', '0', '0', '6', '288', '[{\"uid\":\"images\\/workingfiles\\/161\\/B20.SLDPRT\",\"text\":\"B20.SLDPRT\",\"Date\":\"2013-12-16 07:34:45\",\"imagePath\":\"https:\\/\\/swpuat.s3.amazonaws.com\\/images%2Fworkingfiles%2F161%2FB20.SLDPRT\"}]', '0');
INSERT INTO `quizes` VALUES ('22', '1', 'Q3', 'Open  B21.sldprt. Go to the study named static1. This study uses beam and solid elements. Mesh the study with the default mesh, and solve it. Create a plot of the bending moment in DIR1 for the top beam. Which from answer below is correct?', '', null, '2013-12-16 07:35:16', null, null, null, 'multiple choice', '0', '20', '[{\"uid\":\"https://swpuat.s3.amazonaws.com/images%2FComponents%2F161%2FB21.jpg\",\"text\":\"B21.jpg\",\"imagePath\":\"https://swpuat.s3.amazonaws.com/images%2FComponents%2F161%2FB21.jpg\"}]', '', '0', '0', '6', '288', '[{\"uid\":\"images\\/workingfiles\\/161\\/B21.SLDPRT\",\"text\":\"B21.SLDPRT\",\"Date\":\"2013-12-16 07:36:56\",\"imagePath\":\"https:\\/\\/swpuat.s3.amazonaws.com\\/images%2Fworkingfiles%2F161%2FB21.SLDPRT\"}]', '0');
INSERT INTO `quizes` VALUES ('23', '1', 'Q1', 'Open the frame model B22.sldprt and go to Study 1. The part is created as a weldment and it contains weld gaps. When you open the model, SolidWorks Simulation will automatically calculate the default joints between touching members, but it will ignore connections between the members separated with weld gaps. Correct the joints using any method learned in this exercise. All connections in this weldment are welded. How many magenta joints do you need to accurately represent this model?', '', null, '2013-12-16 07:39:33', null, null, null, 'multiple choice', '0', '0', '[{\"uid\":\"https://swpuat.s3.amazonaws.com/images%2FComponents%2F161%2FB22.jpg\",\"text\":\"B22.jpg\",\"imagePath\":\"https://swpuat.s3.amazonaws.com/images%2FComponents%2F161%2FB22.jpg\"}]', '', '0', '0', '7', '296', '[{\"uid\":\"images\\/workingfiles\\/161\\/B22.SLDPRT\",\"text\":\"B22.SLDPRT\",\"Date\":\"2013-12-16 07:40:41\",\"imagePath\":\"https:\\/\\/swpuat.s3.amazonaws.com\\/images%2Fworkingfiles%2F161%2FB22.SLDPRT\"}]', '0');
