INSERT INTO `quizes` VALUES ('25', '1', 'Q2', 'Open the model B15.sldprt. Setup a basic static study and use beam elements where appropriate. Apply the gravity load of 9.81 m/s2 in the vertical downward direction, and a horizontal force of 500N at the top right corner, as shown in the image.\nApply the fixed geometry fixture at the base of the two uprights. Use the default mesh. What is the maximum vertical displacement in the middle of the beam? (Use millimeters, round your answer to the 4th decimal point.)', '', null, '2013-12-16 07:11:40', null, null, null, 'multiple choice', '0', '10', '[{\"uid\":\"https://swpuat.s3.amazonaws.com/images%2FComponents%2F161%2FB15.jpg\",\"text\":\"B15.jpg\",\"imagePath\":\"https://swpuat.s3.amazonaws.com/images%2FComponents%2F161%2FB15.jpg\"}]', '', '0', '0', '4', '304', '[{\"uid\":\"images\\/workingfiles\\/161\\/B15.SLDPRT\",\"text\":\"B15.SLDPRT\",\"Date\":\"2013-12-16 07:14:05\",\"imagePath\":\"https:\\/\\/swpuat.s3.amazonaws.com\\/images%2Fworkingfiles%2F161%2FB15.SLDPRT\"}]', '0');
