INSERT INTO `quiz_answers` VALUES ('10', '4', 'the intersecting members have to be properly trimmed because intersecting bodies are not allowed in simulation models.', '0', '0', '0', null, '0');
INSERT INTO `quiz_answers` VALUES ('11', '4', 'the beam members do not need to be trimmed. It is ok for the members to extend all the way to the ends of their underlying sketch lines. In this case the beam mesh will therefore extend all the way to the ends of the sketch lines. Because in most situations, ends of the sketch lines will become the joints locations, the resulting beam mesh will likely be cleaner, without any black connecting rigid bars.', '1', '10', '0', null, '0');
