INSERT INTO `quiz_answers` VALUES ('33', '12', 'Most of the fixtures applicable on solid mesh can be used on beam mesh as well. You can select any geometry on a 3D body/part of a beam member, and specify the fixture type. The fixture will then be automatically transferred onto the beam neutral axis or the joint.', '0', '0', '0', null, '0');
INSERT INTO `quiz_answers` VALUES ('34', '12', 'You can define the “Fixed”, “Immovable” or “Using reference geometry” fixture types at beam joints only. Fixtures along the length of the beam are not allowed. ', '1', '10', '0', null, '0');
INSERT INTO `quiz_answers` VALUES ('35', '12', 'Fixed fixture is the only fixture type which can be defined directly on cross-section faces of a beam member. It will then be transferred to the beam joint automatically.', '0', '20', '0', null, '0');
INSERT INTO `quiz_answers` VALUES ('36', '13', 'on faces/edges of the beam member, and on the joints. ', '0', '0', '0', null, '0');
INSERT INTO `quiz_answers` VALUES ('37', '13', 'on the beam joints. Fixtures can also be defined on faces/edges of the beam member, but only if this member is created using the weldment toolkit.', '0', '10', '0', null, '0');
INSERT INTO `quiz_answers` VALUES ('38', '13', 'on beam joints only. ', '1', '20', '0', null, '0');
INSERT INTO `quiz_answers` VALUES ('39', '14', 'They can also be modelled as beams.', '0', '0', '0', null, '0');
INSERT INTO `quiz_answers` VALUES ('40', '14', 'They cannot be included in beam simulations because they cannot be modelled using beam elements.', '0', '10', '0', null, '0');
INSERT INTO `quiz_answers` VALUES ('41', '14', 'They can be included as solid or shell bodies. In most situations, they also have to be bonded to the beams using local bonded contact sets, because the global contact typically fails to recognize this type of incompatible mesh bond. ', '1', '20', '0', null, '0');
