INSERT INTO `quiz_answers` VALUES ('59', '20', 'Yes. Both the normal and shear stress design criteria are satisfied. The long beam is, however, an open cross-section subjected to a significant torsional stress. Assuming that warping is restricted at the fixture location, warping stresses are likely. I would also verify this design using solid elements. ', '1', '0', '0', null, '0');
